ఈ అగ్నిపర్వతం పేరు అబంగ్, గునంగ్.ఈ అగ్నిపర్వత సంఖ్య 264010.దీని ప్రధాన రకం స్త్రతోవోల్కనో ఆఫ్ బేటూరు.ఈ అగ్నిపర్వతం యొక్క భౌగోళిక గతం చారిత్రాత్మకంగా క్రియాశీలంగా ఉన్న బటూర్ అగుంగ్ అగ్నిపర్వతం యొక్క రెండు ఏకకేంద్ర కాల్డెరాస్ ఎన్ డబ్ల్యుల మధ్యలో ఉంది. వెలుపలి 10 x 13.5 కిలోమీటర్ల వెడల్పు గల కాల్డెరా సుమారు 29,300 సంవత్సరాల క్రితం బాలి (లేదా ఉబుద్) ఇగ్నింబ్రైట్ విస్ఫోటనం సమయంలో ఏర్పడింది మరియు ఇప్పుడు దాని SE వైపు ఒక కాల్డెరా సరస్సును కలిగి ఉంది, ఇది సాటెల్లిటిక్ గునుంగ్ అబాంగ్ కోన్ కు ఎదురుగా ఉంది, ఇది కాంప్లెక్స్ యొక్క టోపోగ్రాఫిక్ ఎత్తైనది. లోపలి 6.4 x 9.4 కి.మీ వెడల్పు గల కాల్డెరా సుమారు 20,150 సంవత్సరాల క్రితం గునుంగ్కావి ఇగ్నింబ్రైట్ విస్ఫోటనం సమయంలో ఏర్పడింది. లోపలి కాల్డెరా యొక్క ఎస్ఈ గోడ బటూర్ సరస్సు క్రింద ఉంది; బాతుర్ కోన్ బాహ్య కాల్డెరా రిమ్ పైన ఒక ఎత్తు వరకు లోపలి కాల్డెరా లోపల నిర్మించబడింది. బాతుర్ స్ట్రాటోవోల్కానో లోపలి కాల్డెరాలో ఎక్కువ భాగం మీద వెంట్స్ ను ఉత్పత్తి చేసింది, కానీ ఒక ఎన్ ఈ-ఎస్ డబ్ల్యు విచ్ఛిత్తి వ్యవస్థ శిఖర శిఖరం వెంబడి బతుర్ 1, 2, మరియు 3 క్రేటర్లను స్థానికీకరించింది. చారిత్రాత్మక విస్ఫోటనాలు కొన్నిసార్లు లావా ఉద్గారాలతో పాటు తేలికపాటి నుండి ఒక మాదిరి పేలుడు కార్యకలాపాలతో వర్గీకరించబడ్డాయి. శిఖరం మరియు పార్శ్వ వెంట్స్ రెండింటి నుండి బసాల్టిక్ లావా ప్రవాహాలు చారిత్రాత్మక కాలంలో కాల్డెరా అంతస్తు మరియు బటూర్ సరస్సు యొక్క తీరాలకు చేరుకున్నాయి.
ఈ అగ్నిపర్వతం యునెస్కో గ్లోబల్ జియోపార్క్ ప్రాపర్టీ అయిన బతూర్ లోపల ఉంది.[[వర్గం : అగ్నిపర్వతాలు]] [[ వర్గం : తెవికీ అగ్నిపర్వతాలు]][[వర్గం : స్త్రతోవోల్కనో ఆఫ్ బేటూరు అగ్నిపర్వతాలు]] [[వర్గం : అగ్నిపర్వతాల జాబితా]]

