ఈ అగ్నిపర్వతం పేరు అబెజీరా, మొంతñఅ.ఈ అగ్నిపర్వత సంఖ్య 383030.ఈ అగ్నిపర్వతాన్ని డోమ్ ఆఫ్ టెనరిఫ్ అగ్నిపర్వతంగా వర్గీకరిస్తారు.ఈ అగ్నిపర్వతం యొక్క భౌగోళిక చరిత్ర టెనెరిఫే యొక్క పెద్ద త్రిభుజాకార ద్వీపం చారిత్రాత్మక కాలంలో చురుకుగా ఉన్న మియోసీన్-టు-క్వాటర్నరీ స్ట్రాటోవోల్కానోస్ యొక్క అతివ్యాప్తి చెందిన ఒక సముదాయంతో కూడి ఉంది. NE-ట్రెండింగ్ కార్డిల్లెరా డోర్సల్ అగ్నిపర్వత మాసిఫ్ టెనెరిఫే యొక్క SW వైపున ఉన్న లాస్ కానాడాస్ అగ్నిపర్వతాన్ని పాత అగ్నిపర్వతాలతో కలుపుతుంది, కానరీ ద్వీపాల అతిపెద్ద అగ్నిపర్వత సముదాయాన్ని సృష్టిస్తుంది. అట్లాంటిక్ మహాసముద్రంలో అత్యంత ఎత్తైన శిఖరమైన టెయిడ్ స్ట్రాటోవోల్కానో ద్వారా పాక్షికంగా నింపబడిన 10 x 17 కి.మీ లాస్ కానాడాస్ కాల్డెరా యొక్క నాటకీయ నిర్మాణం చుట్టూ వివాదాలు చుట్టుముట్టాయి. కాల్డెరా యొక్క మూలం బహుళ ప్రధాన పేలుడు విస్ఫోటనాల తరువాత కూలిపోవడం లేదా భారీ కొండచరియలు విరిగిపడటం (భారీ లా ఒరోటావా మరియు గుయిమార్ లోయల యొక్క మునుపటి ఏర్పాటును పోలిన రీతిలో) లేదా రెండు ప్రక్రియల కలయిక కారణంగా భావించబడింది. చివరి ప్లైస్టోసీన్ లో ప్రారంభమైన కార్యకలాపాల యొక్క అత్యంత ఇటీవలి దశలో పికో వియెజో మరియు టెయిడ్ భవనాల నిర్మాణం కూడా ఉంది. టెనెరిఫే బహుశా క్రిస్టోఫర్ కొలంబస్ చే విస్ఫోటనంలో గమనించబడింది, మరియు కానరీ ద్వీపం యొక్క అత్యంత చురుకైన అగ్నిపర్వతం మీద ఉన్న అనేక పార్శ్వ వెంట్స్ చారిత్రాత్మక సమయంలో చురుకుగా ఉన్నాయి.
ఈ అగ్నిపర్వతం యునెస్కో వరల్డ్ హెరిటేజ్ ప్రాపర్టీ అయిన టైడ్ నేషనల్ పార్క్ లోపల ఉంది.[[వర్గం : అగ్నిపర్వతాలు]] [[ వర్గం : తెవికీ అగ్నిపర్వతాలు]][[వర్గం : డోమ్ ఆఫ్ టెనరిఫ్ అగ్నిపర్వతాలు]] [[వర్గం : అగ్నిపర్వతాల జాబితా]]

{{Infobox mountain |name = అబ్‌బీక్, మొంతñఅ డి
