ఈ అగ్నిపర్వతం పేరు అబోర్, జేబెల్ ఎల్.225060 ఈ అగ్నిపర్వత సంఖ్య.దీని ప్రధాన రకం కోన్ ఆఫ్ బయుడ వోల్‌కానిక్ ఫైల్డ్.ఈ అగ్నిపర్వతంసముద్ర మట్టానికి 305 ఎత్తులో ఉంది.ఈ అగ్నిపర్వతం యొక్క భౌగోళిక చరిత్ర నైలు నది యొక్క ప్రధాన అబూ హమీద్ వంపుకు దక్షిణాన, రాజధాని నగరమైన ఖార్టూమ్ కు ఉత్తరంగా 300 కి.మీ.ల దూరంలో ఉన్న ఎన్.ఇ.సూడాన్ లోని బయుడా ఎడారిలో బయుడా అగ్నిపర్వత క్షేత్రం ఉంది. బయుడా ఎడారి మధ్యలో ఉన్న ప్రీకాంబ్రియన్ మరియు పాలియోజోయిక్ గ్రానిటిక్ శిలలపై డబ్ల్యుఎన్ డబ్ల్యు-ఇఎస్ ఇ లైన్ వెంబడి 90 కి పైగా విస్పోటన కేంద్రాలు నిర్మించబడ్డాయి. చాలా వెంట్ లు సిండర్ కోన్ లు, ఇవి లావా ప్రవాహాలను ఉత్పత్తి చేస్తాయి, ఇవి శంఖువులను విచ్ఛిన్నం చేస్తాయి. పొలంలో సుమారు 10% వెంట్స్ విస్ఫోటన బిలాలు, వీటిలో అతిపెద్దవి, హోషెడ్ దలామ్ అని పిలువబడేవి, 1.3 కిలోమీటర్ల వెడల్పు మరియు 500 మీటర్ల లోతు వరకు ఉంటాయి. 5000 సంవత్సరాల క్రితం ముగిసిన సుడాన్ లో తేమతో కూడిన వాతావరణం యొక్క చివరి కాలాన్ని అతి పిన్న వయస్కుడైన బసాల్ట్ లు పోస్ట్-డేట్ చేసినట్లు కనిపిస్తాయి. అతి తక్కువ క్షీణించిన లావా ప్రవాహాలలో ఒకటి సుమారు ౧౧౦౦ సంవత్సరాల క్రితం నాటిది.[[వర్గం : అగ్నిపర్వతాలు]] [[ వర్గం : తెవికీ అగ్నిపర్వతాలు]][[వర్గం : కోన్ ఆఫ్ బయుడ వోల్‌కానిక్ ఫైల్డ్ అగ్నిపర్వతాలు]] [[వర్గం : అగ్నిపర్వతాల జాబితా]]

{{Infobox mountain |name = అబూ |elevation_m =641. |coordinates =అక్షాంశం :34.5, రేఖాంశం : 131.6 |last_eruption =-6850 |location =జపాన్, తైవాన్, మరియనాస్,జపాన్
}}
అబూ అనే పేరుగల అగ్నిపర్వతం జపాన్, తైవాన్, మరియనాస్ ప్రాంతం,జపాన్ దేశంలో ఉంది.ఈ అగ్నిపర్వత సంఖ్య 283001.ఈ అగ్నిపర్వతాన్ని షీల్డ్(స్) అగ్నిపర్వతంగా వర్గీకరిస్తారు., అత్యంత ఇటీవలి విస్ఫోటనం -6850 లో సంభవించింది.ఈ అగ్నిపర్వత అక్షాంశం 34.5 ,రేఖాంశం 131.6.ఈ అగ్నిపర్వతంసముద్ర మట్టానికి 641 ఎత్తులో ఉంది.ఈ అగ్నిపర్వతం యొక్క ప్రాధమిక శిల అందేసితే / బసల్టిక్ అందేసితే. తదుపరి ముఖ్య శిలలు బసల్ట్ / పిక్క్రో-బసల్ట్ దాసితే నాన్ నాన్.అబూ అగ్నిపర్వతం నుండి ఐదు కిలోమీటర్ల వ్యవధిలో ఉన్న జనాబ సుమారు 3597.0.అబూ అగ్నిపర్వతం పది కిలోమీటర్ల పరిధిలో సుమారు 9594.0 మంది జనాభాను కలిగి ఉంది.అబూ అగ్నిపర్వతం ముప్పై కిలోమీటర్ల పరిధిలో సుమారు 117805.0 మంది జనాభాను కలిగి ఉంది.అబూ అగ్నిపర్వతం వంద కిలోమీటర్ల పరిధిలో సుమారు 4071152.0 మంది జనాభాను కలిగి ఉంది.ఈ అగ్నిపర్వతం యొక్క భౌగోళిక చరిత్ర హోన్షు యొక్క SW చివర సమీపంలో జపాన్ సముద్ర తీరం వెంబడి ఉన్న అబూ అగ్నిపర్వత సమూహం, బసాల్టిక్-టు-డాసిటిక్ లావా ప్రవాహాలు, చిన్న కవచ అగ్నిపర్వతాలు (వీటిలో కొన్ని అనుబంధ సిండర్ కోన్లు) మరియు లావా గోపురాలను కలిగి ఉంటాయి. 400 చ.కి.మీ 2 వైశాల్యంలో 40 కంటే ఎక్కువ మోనోజెనెటిక్ అగ్నిపర్వతాలు ఉన్నాయి. ఇరోయామా అగ్నిపర్వతాల యొక్క ఈ సమూహం యొక్క ఉన్నత బిందువును ఏర్పరుస్తుంది, వీటిలో కొన్ని ఆఫ్ షోర్ ద్వీపాలు లేదా జలాంతర్గామి వెంట్ లను ఏర్పరుస్తాయి. ఇక్కడ వోల్కానిజం ఫిలిప్పైన్ సీ ప్లేట్ యొక్క సబ్ డక్షన్ కు సంబంధించినదిగా పరిగణించబడుతుంది. ప్లైయోసీన్ చివరి నుండి ప్రారంభ ప్లైస్టోసీన్ వరకు ప్రబలమైన ప్లైస్టోసీన్ అబూ అగ్నిపర్వత సమూహం వద్ద ఒక మునుపటి దశ కార్యాచరణ తరువాత సుమారు 800,000 సంవత్సరాల క్రితం పునరుద్ధరించబడిన కార్యకలాపాలు హోలోసీన్ వరకు కొనసాగాయి. 8,800 సంవత్సరాల క్రితం థర్మోల్యూమినిసెన్స్ ద్వారా తాజా తేదీ విస్ఫోటనం నిర్ధారించబడింది.[[వర్గం : అగ్నిపర్వతాలు]] [[ వర్గం : తెవికీ అగ్నిపర్వతాలు]][[వర్గం : షీల్డ్(స్) అగ్నిపర్వతాలు]] [[వర్గం : అగ్నిపర్వతాల జాబితా]]



