ఈ అగ్నిపర్వతం పేరు అబ్యద్, జబాల్.ఈ అగ్నిపర్వత సంఖ్య 231060.ఈ అగ్నిపర్వతాన్ని డోమ్ ఆఫ్ ఖేబర్, హర్రాత్ అగ్నిపర్వతంగా వర్గీకరిస్తారు.ఈ అగ్నిపర్వతం యొక్క  భౌగోళిక గతం సౌదీ అరేబియాలోని అతిపెద్ద అగ్నిపర్వత క్షేత్రాలలో ఒకటైన హర్రత్ ఖైబర్ మదీనా (మదీనా) కు ఉత్తరాన 14,000 కి.మీ.2 కంటే ఎక్కువ వైశాల్యం కలిగి ఉంది. 100 కిలోమీటర్ల పొడవైన ఎన్-ఎస్ లీనియర్ వెంట్ సిస్టమ్ లో ఫెల్సిక్ లావా డోమ్ లు, టఫ్ రింగ్ లు, జబల్ క్విడ్ర్ స్ట్రాటోవోల్కానో, అలాగే అనేక చిన్న బసాల్టిక్ కోన్ లు ఉన్నాయి. కనీసం ఏడు నియోలిథిక్ అనంతర (4500 సంవత్సరాల కంటే తక్కువ వయస్సు) మరియు ఎనిమిది "చారిత్రాత్మక" (1500 సంవత్సరాల కంటే తక్కువ) లావా ప్రవాహాలు ఉన్నాయి. తరువాతి వర్గంలో 55 కిలోమీటర్ల పొడవైన హబీర్ లావా ప్రవాహం అలాగే పశ్చిమ సౌదీ అరేబియాలోని హరాట్స్ లో ఏకైక స్ట్రాటోవోల్కానో అయిన జబల్ ఖిద్ర్ స్ట్రాటోవోల్కానో ఉన్నాయి. క్రీ.శ. 7 వ శతాబ్దంలో ప్రారంభ మహమ్మదీయుల కాలంలో ఒక విస్ఫోటనం నివేదించబడింది. హర్రత్ ఖైబర్ నుండి వచ్చిన లావాలు పశ్చిమాన హర్రత్ కురా యొక్క పాత లావాలను అతివ్యాప్తి చేస్తాయి మరియు ఉత్తరాన హర్రత్ ఇత్నాయిన్ నుండి లావాలతో కలుస్తాయి.[[వర్గం : అగ్నిపర్వతాలు]]
