ఆకామరచి , సౌత్ అమెరికా ప్రాంతం,చిలే దేశంలో ఉన్న అగ్నిపర్వతం.ఈ అగ్నిపర్వత సంఖ్య 355096.ఈ అగ్నిపర్వతం ప్రాథమిక రకం స్త్రతోవోల్కనో.ఈ అగ్నిపర్వత అక్షాంశం -23.292 ,రేఖాంశం -67.618.ఈ అగ్నిపర్వతం యొక్క శిఖరం సముద్ర మట్టానికి 6023 మీటర్ల ఎత్తులో ఉంది.ఈ అగ్నిపర్వతం యొక్క ప్రాధమిక శిల దాసితే. అందేసితే / బసల్టిక్ అందేసితే నాన్ నాన్ నాన్అనే శిలలు తరువాతి అత్యంత ముఖ్యమైనవి.ఆకామరచి అగ్నిపర్వతం నుండి ఐదు కిలోమీటర్ల వ్యవధిలో ఉన్న జనాబ సుమారు 0.0.ఆకామరచి అగ్నిపర్వతం నుండి పది కిలోమీటర్ల వ్యవధిలో ఉన్న జనాబ సుమారు 7.0.ఆకామరచి అగ్నిపర్వతం నుండి ముప్పై కిలోమీటర్ల వ్యవధిలో ఉన్న జనాబ సుమారు 294.0.ఆకామరచి అగ్నిపర్వతం నుండి వంద కిలోమీటర్ల వ్యవధిలో ఉన్న జనాబ సుమారు 9092.0.ఈ అగ్నిపర్వతం యొక్క భౌగోళిక చరిత్ర అకమరాచి, ఒక నిటారుగా ఉండే ఆండిసిటిక్-డాసిటిక్ అగ్నిపర్వతం, ఉత్తర ఆండీస్ లోని ఈ భాగంలో ఎత్తైన శిఖరాన్ని ఏర్పరుస్తుంది. సెర్రో పిలి అని కూడా పిలువబడే ఇది పొరుగున ఉన్న కోలాచీ అగ్నిపర్వతం నుండి ఎన్.ఎన్.డబ్ల్యు వరకు విస్తరించిన ఒక చిన్న అగ్నిపర్వత సముదాయం యొక్క SSE చివరన ఉంటుంది. ఒక పెద్ద లావా గోపురం దాని N పార్శ్వంలో ఉంది. పేలవంగా సంరక్షించబడిన శిఖరాగ్ర బిలం మరియు యవ్వన పార్శ్వపు లావా ప్రవాహాలు లేకపోవడం అగ్నిపర్వతం ఎక్కువగా హోలోసీన్ పూర్వ కాలంలో నిర్మించబడిందని సూచిస్తున్నాయి, అయినప్పటికీ ఎగువ శంఖువును కప్పి ఉంచే శిఖరాగ్ర లావా ప్రవాహాలు హోలోసీన్ యుగానికి చెందినవిగా పరిగణించబడ్డాయి (గొంజాలెజ్-ఫెర్రాన్, 1995).[[వర్గం : అగ్నిపర్వతాలు]] [[ వర్గం : తెవికీ అగ్నిపర్వతాలు]][[వర్గం : స్త్రతోవోల్కనో అగ్నిపర్వతాలు]] [[వర్గం : అగ్నిపర్వతాల జాబితా]]



