ఈ అగ్నిపర్వతం పేరు ఆకాటిలడోల్డోస్ రబిజలుంకాస్.ఈ అగ్నిపర్వత సంఖ్య 341023.ఈ అగ్నిపర్వతం ప్రాథమిక రకం టుఫ్ కోన్ ఆఫ్ ఇసేల్సాబెల్, ఇస్లా.ఈ అగ్నిపర్వతం యొక్క  భౌగోళిక గతం టఫ్ శంకువులు మరియు అనుబంధ లావా ప్రవాహాల సముదాయం అయిన ఇస్లా ఇసాబెల్, పసిఫిక్ మహాసముద్రంలో 1.5 కిలోమీటర్ల పొడవైన ఒక చిన్న ద్వీపాన్ని ఏర్పరుస్తుంది, ఇది నారైత్ రాష్ట్ర తీరానికి 30 కిలోమీటర్ల దూరంలో ఉంది, టెపిక్ నగరం యొక్క ఎన్ డబ్ల్యు. మెక్సికన్ అగ్నిపర్వత బెల్ట్ యొక్క పశ్చిమ చివరన దాని స్పష్టమైన స్థానం ఉన్నప్పటికీ, ఇస్లా ఇసాబెల్ ఆల్కలైన్ బసాల్టిక్ శిలలు మరియు ఇతర మెక్సికన్ ద్వీప అగ్నిపర్వతాల మాదిరిగానే మరియు ఉత్తర మెక్సికన్ ఎక్స్ టెన్షన్ ప్రావిన్స్ లో ఉన్న టెఫ్రాను కలిగి ఉంది. ఈ ద్వీపం ఒక వన్యప్రాణుల అభయారణ్యం, దీని రాళ్ళు మరియు వృక్షసంపద గ్వానోతో కప్పబడి ఉంటాయి. ద్వీపాన్ని ఏర్పరిచే టఫ్ కోన్ ల యొక్క లోపలి భాగం యొక్క అద్భుతమైన ఎక్స్ పోజర్ లు ప్రధాన ద్వీపం యొక్క సముద్ర కొండలు మరియు ఆఫ్ షోర్ ద్వీపాలలో కనుగొనవచ్చు. అత్యంత ఇటీవలి విస్పోటన చర్య యొక్క వయస్సు తెలియదు, కానీ ఒక యువ నమూనా నుండి రూపశాస్త్రం మరియు ప్రతికూల ఆర్గాన్-ఆర్గాన్ వయస్సు హోలోసీన్ వరకు కార్యకలాపాలు కొనసాగి ఉండవచ్చని సూచిస్తున్నాయి. తెలియని యుగానికి చెందిన ఒక యవ్వనంగా కనిపించే అన్వెజిటేటెడ్ లావా ప్రవాహం ద్వీపం యొక్క ఎన్ డబ్ల్యు వైపు ఉంది.[[వర్గం : అగ్నిపర్వతాలు]]
