{{Infobox mountain |name = అక్యాటెనంగో |elevation_m =3976. |coordinates =అక్షాంశం :14.501, రేఖాంశం : -90.876 |last_eruption =1972 |location =మీéక్సికో అండ్ సెంత్రల్ అమెరికా,గ్యాటెమల
}}
అక్యాటెనంగో , మీéక్సికో అండ్ సెంత్రల్ అమెరికా ప్రాంతం,గ్యాటెమల దేశంలో ఉన్న అగ్నిపర్వతం.ఈ అగ్నిపర్వత సంఖ్య 342080.ఈ అగ్నిపర్వతం ప్రాథమిక రకం స్త్రతోవోల్కనో(ఎస్).ఈ అక్యాటెనంగో అగ్నిపర్వతం చివరిసారిగా 1972 లో విస్ఫోటనం చెందింది.ఈ అగ్నిపర్వత అక్షాంశం 14.501 ,రేఖాంశం -90.876.ఈ అగ్నిపర్వతం యొక్క శిఖరం సముద్ర మట్టానికి 3976 మీటర్ల ఎత్తులో ఉంది.ఈ అగ్నిపర్వతం ప్రధానంగా శిల అందేసితే / బసల్టిక్ అందేసితే తో ఏర్పడింది.దాసితే నాన్ నాన్ బసల్ట్ / పిక్క్రో-బసల్ట్తరువాతి అత్యంత ముఖ్యమైన శిలలు.అక్యాటెనంగో అగ్నిపర్వతం నుండి ఐదు కిలోమీటర్ల వ్యవధిలో ఉన్న జనాబ సుమారు 4329.0.అక్యాటెనంగో అగ్నిపర్వతం నుండి పది కిలోమీటర్ల వ్యవధిలో ఉన్న జనాబ సుమారు 60730.0.అక్యాటెనంగో అగ్నిపర్వతం ముప్పై కిలోమీటర్ల పరిధిలో సుమారు 1042836.0 మంది జనాభాను కలిగి ఉంది.అక్యాటెనంగో అగ్నిపర్వతం నుండి వంద కిలోమీటర్ల వ్యవధిలో ఉన్న జనాబ సుమారు 7634778.0.ఈ అగ్నిపర్వతం యొక్క భౌగోళిక చరిత్ర అకాటెనాంగో, దక్షిణాన దాని జంట అగ్నిపర్వతంతో పాటు, వోల్కాన్ ఫ్యూగో, చారిత్రాత్మక మాజీ రాజధాని నగరం ఆంటిగ్వా, గ్వాటెమాల వైపు చూస్తుంది. రెండు ప్రధాన శిఖరాగ్ర శిఖరాలు మూడు విస్ఫోటన కాలాల్లో నిర్మించబడ్డాయి, సుమారు 85,000 సంవత్సరాల వయస్సు గల లాస్ చోకోయోస్ టెఫ్రాకు అటిట్లాన్ కాల్డెరాకు చెందినవి. ఒక పూర్వీకులైన అకాటెనాంగో అగ్నిపర్వతం 43,000 సంవత్సరాల క్రితం దక్షిణం వైపు కూలిపోయింది, ఇది లా డెమోక్రసియా శిధిలాలు-హిమపాతం నిక్షేపాన్ని ఏర్పరుస్తుంది, ఇది పసిఫిక్ తీర మైదానంలోని విశాలమైన ప్రాంతాన్ని కవర్ చేస్తుంది. అకాటెనాంగో యొక్క ఉత్తర శిఖరాగ్ర శిఖరమైన యెపోకాపా నిర్మాణం సుమారు 20,000 సంవత్సరాల క్రితం పూర్తయింది, దీని తరువాత దక్షిణ మరియు ఎత్తైన శంఖువు, పికో సెంట్రల్ (పికో మేయర్ అని కూడా పిలుస్తారు) యొక్క పెరుగుదల ప్రారంభమైంది. మునుపటి చారిత్రక విస్ఫోటనాలు సంభవించినప్పటికీ, 1924 నుండి 1927 వరకు మొదటి బాగా డాక్యుమెంట్ చేయబడిన విస్ఫోటనాలు సంభవించాయి. ఫ్రాన్సిస్కో వాస్క్వెజ్ 1690లో వ్రాస్తూ, 1661లో ఫ్యూగోను పక్కన పెట్టివున్న ఒక అగ్నిపర్వత౦ "ధూమపాన నోరు తెరచి, ఇ౦కా మరో ముగ్గురి ను౦డి పొగను వెదజల్లుతు౦ది, కానీ చప్పుడు లేకు౦డానే" ఉ౦టు౦దని పేర్కొన్నాడు.[[వర్గం : అగ్నిపర్వతాలు]] [[ వర్గం : తెవికీ అగ్నిపర్వతాలు]][[వర్గం : స్త్రతోవోల్కనో(ఎస్) అగ్నిపర్వతాలు]] [[వర్గం : అగ్నిపర్వతాల జాబితా]]



