ఈ అగ్నిపర్వతం పేరు ఆక్ట్ల్áన్, సెర్రో.ఈ అగ్నిపర్వత సంఖ్య 341095.ఈ అగ్నిపర్వతం ప్రాథమిక రకం పిరోక్లాస్టిక్టిక్ కోన్ ఆఫ్ నాలింకో వోల్‌కానిక్ ఫైల్డ్.ఈ అగ్నిపర్వతం యొక్క  భౌగోళిక గతం వెరాక్రూజ్ రాష్ట్ర రాజధాని నగరమైన జలపా (క్సాలాపా) కు ఉత్తరాన సియెర్రా డి చికోంక్వియాకో శ్రేణిలోని నవోలింకో అగ్నిపర్వత క్షేత్రంలో చెల్లాచెదురుగా ఉన్న క్వాటర్నరీ పైరోక్లాస్టిక్ శంకువులు మరియు దానితో సంబంధం ఉన్న ప్రబలమైన బసాల్టిక్ లావా ప్రవాహాలు ఉన్నాయి. లేట్-ప్లైస్టోసీన్ నుండి హోలోసీన్ పైరోక్లాస్టిక్ శంకువులు నయోలిన్కో డి విక్టోరియా పట్టణానికి ఇరువైపులా ఇ-డబ్ల్యు-ట్రెండింగ్ ప్రాంతాన్ని కవర్ చేస్తాయి. అతిపెద్ద శంఖువు 2000-మీ-ఎత్తైన సెర్రో అకాట్లాన్, ఇది నవోలింకో డి విక్టోరియా యొక్క NE లో ఉంది. ఇది మరియు ఇతర సమీప శంకువులు దక్షిణం మరియు ఎస్ఈకి ప్రాంతీయ గ్రేడియెంట్ల ద్వారా ప్రయాణించే భారీ లావా ప్రవాహాలను తినిపించాయి. పొలము యొక్క పశ్చిమ భాగములో ఉన్న రింకోన్ డి చాపుల్టెపెక్ స్కోరియా కోన్ నుండి కోకాట్జింట్లా లావా ప్రవాహం సుమారు 3000 సంవత్సరాల క్రితం విస్ఫోటనం చెందింది మరియు ఇది నవోలింకో అగ్నిపర్వత క్షేత్రం యొక్క అతి పిన్న వయస్కుడైన ప్రవాహం.[[వర్గం : అగ్నిపర్వతాలు]]
    [[ వర్గం : తెవికీ అగ్నిపర్వతాలు]][[వర్గం : పిరోక్లాస్టిక్టిక్ కోన్ ఆఫ్ నాలింకో వోల్‌కానిక్ ఫైల్డ్ అగ్నిపర్వతాలు]]
