ఈ అగ్నిపర్వతం పేరు అచాచరా, లోమ.ఈ అగ్నిపర్వత సంఖ్య 354004.దీని ప్రధాన రకం పిరోక్లాస్టిక్టిక్ కోన్ ఆఫ్ అందహువ-ఆర్కోపంప.ఈ అగ్నిపర్వతం యొక్క  భౌగోళిక గతం అండహువా (లేదా అండగువా) లోయ ప్రాంతంలో అండహువా-ఓర్కోపాంప అగ్నిపర్వత క్షేత్రం, నెవాడోస్ డి కొరోపునాకు 20 కి.మీ.ల ENE, 60 x 60 కి.మీ.ల పెద్ద స్కోరియా శంఖువు మరియు లావా క్షేత్రం ఉంది. స్థానికంగా "అగ్నిపర్వతాల లోయ" అని పిలువబడే ఈ అగ్నిపర్వత క్షేత్రం లోతైన NNW-SSE-ట్రెండింగ్, ఎన్-ఎచెలాన్ లోయల శ్రేణిలో ఉంది: ఓర్కోపాంప, అండహువా, మరియు అయో. అగ్నిపర్వత క్షేత్రంలో అత్యంత యవ్వనంగా ఆధిపత్యం చెలాయిస్తున్న ట్రాచ్యాండెసిటిక్ సిండర్ కోన్లు మరియు లావా ప్రవాహాలు ఉన్నాయి, ఇవి భవనాలను నాశనం చేశాయి మరియు కొన్ని వందల సంవత్సరాల నాటివి కావచ్చు. ఈ ప్రాంతం ఇన్కాస్ కాలంలో క్రియాశీలకంగా ఉందని మరియు 1913 లో "మళ్ళీ చురుకుగా మారింది" అని నివేదించబడింది. లావా ప్రవాహాలు రియో అండగువా లోయను పదేపదే ఆనకట్టలు చేశాయి, మరియు ఇప్పటికే ఉన్న ఒక చిన్న సరస్సును చిన్న లావాలు స్వాధీనం చేసుకున్నాయి.[[వర్గం : అగ్నిపర్వతాలు]]
    [[ వర్గం : తెవికీ అగ్నిపర్వతాలు]][[వర్గం : పిరోక్లాస్టిక్టిక్ కోన్ ఆఫ్ అందహువ-ఆర్కోపంప అగ్నిపర్వతాలు]]
