ఈ అగ్నిపర్వతం పేరు అచిన్-నీళ్ళు.357123 ఈ అగ్నిపర్వత సంఖ్య.దీని ప్రధాన రకం కోన్ ఆఫ్ హంక్విహ్యూ గ్రూప్.ఈ అగ్నిపర్వతం యొక్క  భౌగోళిక గతం లానిన్ అగ్నిపర్వతానికి దక్షిణాన చిలీ సరిహద్దుకు సమీపంలో అర్జెంటీనాలో యువ బసాల్టిక్ అగ్నిపర్వతాల సమూహం ఉంది. హుయాన్క్విహుయే అగ్నిపర్వత సమూహం ప్లైస్టోసీన్ యుగానికి చెందిన స్ట్రాటోవోల్కానోల యొక్క ఎన్ఎన్ఇ-ఎస్.ఎస్.డబ్ల్యు-ట్రెండింగ్ గొలుసును కలిగి ఉంది, వీటిలో కొన్ని సరిహద్దు వెంబడి ఉన్నాయి. ఒక హోలోసీన్ కాంపౌండ్ సిండర్ కోన్, 400 మీటర్ల వ్యాసం వరకు ఉన్న మూడు గూడు బిలాలతో, సెర్రో హువాన్క్విహుయే యొక్క లోయను ఆక్రమించింది మరియు హిమానీనద సరస్సు ఎపులాఫ్క్వెన్ లోపల నిర్మించిన టఫ్ కోన్ గొలుసు యొక్క ఉత్తర చివరన ఉంది. ఈ హోలోసీన్ టఫ్ కోన్, లా అంగోస్ట్యూరా ("ది నారోయింగ్") యొక్క పెరుగుదల ఒక ద్వీపకల్పాన్ని సృష్టించింది, ఇది సరస్సు ఎపులాఫ్క్వెన్ మరియు సరస్సు హ్యూచులాఫ్కెన్ లను కలుపుతూ ఒక ఇరుకైన కాలువను ఏర్పాటు చేసింది. అచిన్-నీల్లు సిండర్ కోన్ (సెర్రో ఎస్కోరియల్ అని కూడా పిలుస్తారు) యొక్క బేస్ నుండి చాలా ఇటీవలి లావా ప్రవాహం హిమానీనద లాగో ఎపులాఫ్క్వెన్ లోకి ఉత్తరంగా ప్రయాణించి, ఒక ప్రముఖ లావా డెల్టాను ఏర్పరుస్తుంది. ఎస్కోరియల్ లావా ప్రవాహం అనేది అత్యంత యవ్వన ప్రవాహం, ఇది స్థానిక డ్రైనేజీలను మళ్లించి కొత్త సరస్సులను ఏర్పరుస్తుంది. ప్రస్తుతానికి సుమారు 200 సంవత్సరాల ముందు రేడియోకార్బన్ తేదీ ఈ ప్రవాహం నుండి పొందబడింది, మరియు స్థానిక నివాసితులు విస్ఫోటనం యొక్క మౌఖిక చరిత్రలను వివరిస్తారు, దీనిని వారి తాత ముత్తాతలు గమనించారు.[[వర్గం : అగ్నిపర్వతాలు]]
    [[ వర్గం : తెవికీ అగ్నిపర్వతాలు]][[వర్గం : కోన్ ఆఫ్ హంక్విహ్యూ గ్రూప్ అగ్నిపర్వతాలు]]
