ఈ అగ్నిపర్వతం పేరు అచ్చిల్లాల్లాల్.345050 ఈ అగ్నిపర్వత సంఖ్య.దీని ప్రధాన రకం స్త్రతోవోల్కనో ఆఫ్ బర్వా.ఈ అగ్నిపర్వతం యొక్క  భౌగోళిక చరిత్ర రాజధాని నగరమైన శాన్ జోస్ కు సమీపంలో ఉన్న మూడు భారీ అగ్నిపర్వతాలలో ఒకటైన వోల్కాన్ బర్వా (బార్బా) బహుళ శిఖరాలు మరియు పార్శ్వపు వెంట్ లతో కూడిన ఒక సంక్లిష్టమైన అగ్నిపర్వతం. సెంట్రల్ వ్యాలీ నుండి కనిపించే మూడు శిఖరాలు దీనికి లాస్ ట్రెస్ మారియాస్ అనే సాధారణ స్థానిక పేరును ఇస్తాయి. సెంట్రల్ వ్యాలీలో బహిర్గతమైన భారీ అండెసిటిక్-టు-డాసిటిక్ టిరిబి టఫ్ సుమారు 322,000 సంవత్సరాల క్రితం విస్ఫోటనం చెందింది. శిఖరాగ్ర ప్రాంతం ఈఎస్ఈకి తెరిచిన 2 x 3 కిలోమీటర్ల బిలం ద్వారా ఆధిపత్యం చెలాయిస్తుంది. ఎగువ ఎన్ పార్శ్వంలో ఉన్న శంఖువులలో ఒకటి క్రేటర్ సరస్సును కలిగి ఉంటుంది. లావా ప్రవాహాలతో పాటు S పార్శ్వాలపై కూడా శంకువులు కనిపిస్తాయి. లాస్ ఏంజిల్స్ ప్రవాహం, ఇటీవలి వాటిలో ఒకటి, దాదాపు హెరేడియా నగరానికి దిగుతుంది. ప్రారంభ హోలోసీన్ సమయంలో పెద్ద ప్లినియన్ విస్ఫోటనం సంభవించింది. విస్ఫోటనాలు 1760 లేదా 1766, 1776 లో నివేదించబడ్డాయి? (ఒక బురద ప్రవాహం కూడా), మరియు 1867, కానీ తరువాత శిఖరాగ్రానికి సందర్శనలు ఇటీవలి కార్యకలాపాలకు ఆధారాలను అందించలేదు.[[వర్గం : అగ్నిపర్వతాలు]]
    [[ వర్గం : తెవికీ అగ్నిపర్వతాలు]][[వర్గం : స్త్రతోవోల్కనో ఆఫ్ బర్వా అగ్నిపర్వతాలు]]
