ఈ అగ్నిపర్వతం పేరు అచ్చి-యామ.284020 ఈ అగ్నిపర్వత సంఖ్య.ఈ అగ్నిపర్వతాన్ని డోమ్ ఆఫ్ నీజిమా అగ్నిపర్వతంగా వర్గీకరిస్తారు.ఈ అగ్నిపర్వతం యొక్క  భౌగోళిక చరిత్ర ఒషిమాకు చెందిన ఎస్.ఎస్.డబ్ల్యు, పొడవైన నిజిమా ద్వీపం 11 కి.మీ పొడవు మరియు కేవలం 2.5 కి.మీ వెడల్పు మాత్రమే. ఇది ఎనిమిది తక్కువ రైయోలిటిక్ లావా గోపురాలను కలిగి ఉంది, ఇవి ద్వీపం యొక్క ఉత్తర మరియు దక్షిణ చివరల వద్ద రెండు సమూహాలుగా సమూహంగా ఉంటాయి, తక్కువ, చదునైన ఇస్త్మస్ ద్వారా వేరు చేయబడతాయి. చదునైన గోపురాలు ఈ ద్వీపానికి నిటారుగా ఉన్న కొండలతో చుట్టబడిన రెండు పెద్ద పీఠభూముల రూపాన్ని ఇస్తాయి. ఈ ద్వీపం యొక్క దక్షిణ చివరన ఉన్న ముకైయామా సముదాయం మరియు ఉత్తర చివరన ఉన్న అచియామా లావా గోపురం క్రీ.శ 9 వ శతాబ్దంలో నిజిమా యొక్క ఏకైక చారిత్రక విస్ఫోటనాల సమయంలో ఏర్పడ్డాయి. షికినేయామా మరియు జినైటో గోపురాలు వోల్కానిజం యొక్క ప్రారంభ దశలలో వరుసగా ఎస్ డబ్ల్యు మరియు పశ్చిమానికి వెంటనే చిన్న ద్వీపాలను ఏర్పరుస్తాయి. 20 వ శతాబ్దంలో భూకంపం సంభవించింది.[[వర్గం : అగ్నిపర్వతాలు]]
