ఈ అగ్నిపర్వతం పేరు అసిగోల్.213001 ఈ అగ్నిపర్వత సంఖ్య.ఈ అగ్నిపర్వతాన్ని క్రేటర్ ఆఫ్ కరాపీణర్ ఫైల్డ్ అగ్నిపర్వతంగా వర్గీకరిస్తారు.ఈ అగ్నిపర్వతం 38.325 డిగ్రీల అక్షాంశం మరియు 34.37 డిగ్రీల రేఖాంశం మద్యలో లో ఉంటుంది.సముద్ర మట్టానికి 1689 మీటర్ల ఎత్తులో ఈ అగ్నిపర్వతం ఉంది.ఈ అగ్నిపర్వతం యొక్క భౌగోళిక చరిత్ర బసాల్టిక్ కరాపినార్ అగ్నిపర్వత క్షేత్రంలో ఐదు సిండర్ కోన్లు, రెండు లావా క్షేత్రాలు, మరియు అనేక విస్ఫోటన క్రేటర్లు మరియు మార్లు కరాకాడాగ్ స్ట్రాటోవోల్కానో యొక్క కొన్యా-ఎరెగ్లీ మైదాన ఎస్డబ్ల్యుపై ఎస్డబ్ల్యు-ఎన్ఇ లైన్ వెంబడి ఉన్నాయి. విస్పోటనాల సమయంలో వివిధ సరస్సు నీటి మట్టాలను ప్రతిబింబిస్తూ, హైలోక్లాస్టిట్ టఫ్ రింగుల నుండి మోర్స్ నుండి సిండర్ కోన్ల వరకు ఈ మార్స్ ఉద్భవించాయి. సెంట్రల్ అనటోలియాలోని అతిపెద్ద సిండర్ కోన్ లలో మెకే డాగి ఒకటి.[[వర్గం : అగ్నిపర్వతాలు]] [[ వర్గం : తెవికీ అగ్నిపర్వతాలు]][[వర్గం : క్రేటర్ ఆఫ్ కరాపీణర్ ఫైల్డ్ అగ్నిపర్వతాలు]] [[వర్గం : అగ్నిపర్వతాల జాబితా]]

