అకూమా, మోర్న్ , డొమినికా ప్రాంతం,కారిబియన్ లెస్సెర్ అంటిల్లెస్ దేశంలో ఉన్న అగ్నిపర్వతం.360110 ఈ అగ్నిపర్వత సంఖ్య.ఈ అగ్నిపర్వతం ప్రాథమిక రకం డోమ్ ఆఫ్ ప్లాట్ పేస్, మోర్న్.ఈ అగ్నిపర్వతం నుండి చివరగ వెలువడిన విస్ఫోటనం 30000yrs సంవత్సరంలో జరిగింది.ఈ అగ్నిపర్వతం 15.3 డిగ్రీల అక్షాంశం మరియు -61.23 డిగ్రీల రేఖాంశం మద్యలో లో ఉంటుంది.ఈ అగ్నిపర్వతం యొక్క శిఖరం సముద్ర మట్టానికి 1447 మీటర్ల ఎత్తులో ఉంది.ఈ అగ్నిపర్వతం యొక్క భౌగోళిక గతం మోర్నే ప్లాట్ పేస్ అగ్నిపర్వత సముదాయం డొమినికా ద్వీపం యొక్క దక్షిణ కొనను ఆక్రమించింది మరియు హోలోసీన్ అంతటా చురుకుగా ఉంది. సుమారు 39,000 సంవత్సరాల క్రితం ఒక పెద్ద పేలుడు విస్ఫోటనం మరియు పార్శ్వ పతనం ఫలితంగా ఏర్పడిన ఒక ఆర్కుయేట్ కాల్డెరా పశ్చిమాన సౌఫ్రియర్ బేకు తెరిచి ఉంది. ఈ మాంద్యం మోర్నే ప్లాట్ పేస్ స్ట్రాటోవోల్కానో యొక్క ఎస్ డబ్ల్యు వైపును కత్తిరించి డొమినికా యొక్క దక్షిణ కొన వరకు విస్తరించింది. స్కాట్స్ హెడ్ కు దక్షిణంగా ఒక జలాంతర్గామి గోపురంతో సహా కనీసం డజను చిన్న కాల్డెరా అనంతర లావా గోపురాలు ఈ మాంద్యం లోపల మరియు వెలుపల ఉంచబడ్డాయి. ఇటీవలి కాలం నాటి విస్ఫోటనాలు మోర్నే పాటేస్ లావా గోపురం నుండి సుమారు క్రీ.శ 1270 లో సంభవించాయి, అయినప్పటికీ యువ నిక్షేపాలు ఇంకా తేదీ వేయబడలేదు. ఈ సముదాయం విస్తృతమైన ఫ్యూమరోలిక్ కార్యకలాపాల ప్రదేశం, మరియు కనీసం పది చిన్న-పరిమాణ భూకంపాలు, విస్ఫోటన కార్యకలాపాలతో సంబంధం లేనివి, మోర్నే పాటేట్స్ వద్ద 1765 నుండి సంభవించాయి.[[వర్గం : అగ్నిపర్వతాలు]] [[ వర్గం : తెవికీ అగ్నిపర్వతాలు]][[వర్గం : డోమ్ ఆఫ్ ప్లాట్ పేస్, మోర్న్ అగ్నిపర్వతాలు]] [[వర్గం : అగ్నిపర్వతాల జాబితా]]



