ఈ అగ్నిపర్వతం పేరు అక్వేరియం.ఈ అగ్నిపర్వత సంఖ్య 284201.దీని ప్రధాన రకం థర్మల్ ఆఫ్ ఈస్ట్ దిమంతే.ఈ అగ్నిపర్వతం యొక్క  భౌగోళిక చరిత్ర డాసిటిక్ ఈస్ట్ డయామాంటే జలాంతర్గామి అగ్నిపర్వతం ఎన్ఈ వైపు ఒక ఉచ్ఛరించబడిన రిమ్తో పొడవైన ఎన్ఈ-ఎస్డబ్ల్యు-ట్రెండింగ్ కాల్డెరాను కలిగి ఉంది. ఒక పెద్ద పోస్ట్-కాల్డెరా కోన్ SW కాల్డెరా రిమ్ మీద ఉంది, మరియు కాల్డెరా మధ్యలో లావా గోపురాల సముదాయం నిర్మించబడింది. బ్లాక్ ఫారెస్ట్ సైట్ వద్ద "బ్లాక్ స్మోకర్" సల్ఫైడ్ చిమ్నీలతో సహా హైడ్రో థర్మల్ యాక్టివిటీ యొక్క అనేక ప్రాంతాలు సెంట్రల్ డోమ్ కాంప్లెక్స్ పై కేవలం కొన్ని వందల మీటర్ల లోతులో కనుగొనబడ్డాయి. ఇవి ఇంకా కనుగొనబడిన నిస్సారమైన నల్ల ధూమపానం చేసేవారిని గుర్తించాయి. ఈ శిఖరం సముద్ర ఉపరితలానికి 127 మీటర్ల లోపల విస్తరించి ఉంది. వెస్ట్ డియామాంటే సీమౌంట్ 28 కి.మీ డబ్ల్యు, చాలా చిన్న మిడిల్ డయామాంటే సుమారు 15 కి.మీ డబ్ల్యు.[[వర్గం : అగ్నిపర్వతాలు]]
    [[ వర్గం : తెవికీ అగ్నిపర్వతాలు]][[వర్గం : థర్మల్ ఆఫ్ ఈస్ట్ దిమంతే అగ్నిపర్వతాలు]]
    [[వర్గం : అగ్నిపర్వతాల జాబితా]]

{{Infobox mountain |name = యాక్క్వ్ కాల్డ్
