ఈ అగ్నిపర్వతం పేరు యాక్క్వ్ కాల్డ్.ఈ అగ్నిపర్వత సంఖ్య 211050.ఈ అగ్నిపర్వతాన్ని థర్మల్ ఆఫ్ వుల్కనో అగ్నిపర్వతంగా వర్గీకరిస్తారు.ఈ అగ్నిపర్వతం యొక్క భౌగోళిక చరిత్ర అగ్నిపర్వతం అనే పదం ఇటలీలోని అయోలియన్ దీవుల్లోని వల్కానో స్ట్రాటోవోల్కనో నుండి ఉద్భవించింది. వల్కానో గత 136,000 సంవత్సరాలలో ఆరు దశలలో నిర్మించబడింది. రెండు అతివ్యాప్తి చెందుతున్న కాల్డెరాస్, SE పై 2.5 కిలోమీటర్ల వెడల్పు కాల్డెరా డెల్ పియానో మరియు NW మీద 4-కి.మీ-వెడల్పు కాల్డెరా డెల్లా ఫోస్సా, వరుసగా 100,000 మరియు 24,000-15,000 సంవత్సరాల క్రితం ఏర్పడ్డాయి, మరియు వోల్కానిజం కాలక్రమేణా ఉత్తరానికి వలస వెళ్ళింది. లా ఫోసా కోన్, హోలోసీన్ అంతటా చురుకుగా మరియు చాలా చారిత్రక విస్ఫోటనాల స్థానం, పొడవైన 3 x 7 కి.మీ ద్వీపం యొక్క ఎన్ డబ్ల్యు చివరలో 3-కి.మీ వెడల్పు గల కాల్డెరా డెల్లా ఫోస్సాను ఆక్రమించింది. వల్కనెల్లో లావా వేదిక అనేది వల్కనో యొక్క ఉత్తర కొనలో ఒక తక్కువ, స్థూలంగా వృత్తాకార ద్వీపకల్పం, ఇది 2,000 సంవత్సరాల క్రితం ప్రారంభమైన ఒక ద్వీపంగా ఏర్పడింది మరియు సుమారు 1550 సా.శ. 1550 లో ప్రధాన ద్వీపంతో అనుసంధానించబడింది. వల్కనెల్లో మూడు పైరోక్లాస్టిక్ శంకువులచే కప్పబడి ఉంది మరియు 16 వ శతాబ్దం వరకు అడపాదడపా చురుకుగా ఉంది. 1898 నుండి 1900 వరకు ఫోసా శంఖువు వద్ద పేలుడు కార్యకలాపాలు జరిగాయి.
ఈ అగ్నిపర్వతం యునెస్కో ప్రపంచ వారసత్వ సంపద అయిన ఐసోల్ ఇయోలీ (ఎయోలియన్ దీవులు) లోపల ఉంది.[[వర్గం : అగ్నిపర్వతాలు]] [[ వర్గం : తెవికీ అగ్నిపర్వతాలు]][[వర్గం : థర్మల్ ఆఫ్ వుల్కనో అగ్నిపర్వతాలు]] [[వర్గం : అగ్నిపర్వతాల జాబితా]]



