ఈ అగ్నిపర్వతం పేరు అక్రోపోలి.ఈ అగ్నిపర్వత సంఖ్య 211071.ఈ అగ్నిపర్వతం ప్రాథమిక రకం కోన్ ఆఫ్ పాంటెలీరియా.ఈ అగ్నిపర్వతం యొక్క  భౌగోళిక గతం పాంటెల్లెరియా ద్వీపం సిసిలీ జలసంధిలో మునిగిపోయిన ఖండాంతర చీలిక పైన నిర్మించబడింది మరియు ఇది తీవ్రమైన అగ్నిపర్వత-టెక్టోనిక్ కార్యకలాపాలకు కేంద్రంగా ఉంది. రెండు పెద్ద ప్లైస్టోసీన్ కాల్డెరాస్ ద్వీపంలో ఆధిపత్యం చెలాయిస్తాయి, ఇది అనేక కాల్డెరా లావా గోపురాలను మరియు సిండర్ కోన్లను కలిగి ఉంది మరియు ఇది పెరాల్కలైన్ రైయోలిటిక్ శిలలు, పాంటెల్లైట్స్ యొక్క రకం స్థానికత. 15 కిలోమీటర్ల పొడవైన ఈ ద్వీపం ఎక్కువగా జలాంతర్గామి భవనం యొక్క ఉద్భవించిన శిఖరం. 6 కిలోమీటర్ల వెడల్పు గల సిన్క్యూ డెంటీ కాల్డెరా, రెండు కాల్డెరాలలో చిన్నది, సుమారు 45,000 సంవత్సరాల క్రితం ఏర్పడింది మరియు మోంటే గ్రాండే మరియు మోంటే గిబెలే యొక్క రెండు పోస్ట్-కాల్డెరా షీల్డ్ అగ్నిపర్వతాలను కలిగి ఉంది. హోలోసీన్ విస్ఫోటనాలు ప్యూమిస్ కోన్లు, లావా గోపురాలు మరియు చిన్న, బ్లాకీ లావా ప్రవాహాలను నిర్మించాయి. అనేక హోలోసీన్ వెంట్స్ ద్వీపం యొక్క SE వైపు ఉన్న ఎత్తైన మోంటాగ్నా గ్రాండే బ్లాక్ కు మూడు వైపులా ఉన్నాయి. 1891లో ఎన్ డబ్ల్యు తీరానికి ~4 కి.మీ దూరంలో ఉన్న ఒక వెంట్ నుండి జలాంతర్గామి విస్ఫోటనం మాత్రమే ధృవీకరించబడిన చారిత్రక చర్య.[[వర్గం : అగ్నిపర్వతాలు]]
