ఈ అగ్నిపర్వతం పేరు అక్టివ్ క్రేటర్.345020 ఈ అగ్నిపర్వత సంఖ్య.ఈ అగ్నిపర్వతాన్ని క్రేటర్ ఆఫ్ రింకాన్ డి లా వీజ అగ్నిపర్వతంగా వర్గీకరిస్తారు.ఈ అగ్నిపర్వతం యొక్క భౌగోళిక చరిత్ర NW కోస్టారికాలో అతిపెద్ద అగ్నిపర్వతమైన రింకోన్ డి లా వియెజా గ్వానాకాస్టే శ్రేణిలోని ఒక మారుమూల అగ్నిపర్వత సముదాయం. ఈ అగ్నిపర్వతం 15 కి.మీ.ల వెడల్పు గల ప్రారంభ ప్లైస్టోసీన్ గ్వాచిపెలిన్ కాల్డెరా లోపల నిర్మించిన పొడవైన, ఆర్కుయేట్ ఎన్ డబ్ల్యు-ఎస్.ఇ-ట్రెండింగ్ రిడ్జ్ ను కలిగి ఉంది, దీని అంచు దక్షిణం వైపు బహిర్గతం అవుతుంది. కొన్నిసార్లు "కొలోస్సస్ ఆఫ్ గ్వానాకాస్టే" అని పిలువబడే ఇది 130 చ.కి.మీ 3 యొక్క అంచనా పరిమాణాన్ని కలిగి ఉంది మరియు కనీసం తొమ్మిది ప్రధాన విస్ఫోటన కేంద్రాలను కలిగి ఉంది. యాక్టివిటీ ఎస్ఈకి వలస వెళ్లింది, ఇక్కడ అతి పిన్న వయస్కులుగా కనిపించే క్రేటర్లు ఉంటాయి. శాంటా మారియా అగ్నిపర్వతం యొక్క జంట శంఖువు, కాంప్లెక్స్ యొక్క ఎత్తైన శిఖరం, ఒక చిన్న, 5-కి.మీ-వెడల్పు గల కాల్డెరా యొక్క తూర్పు చివరన ఉంది మరియు 500-మీ-వెడల్పు గల బిలం కలిగి ఉంది. సుమారు 3,500 సంవత్సరాల క్రితం 0.25 చ.కి.మీ 3 రియో బ్లాంకా టెఫ్రాను ఉత్పత్తి చేసే ప్లినియన్ విస్ఫోటనం చివరి ప్రధాన మాగ్మాటిక్ విస్ఫోటనం. 16 వ శతాబ్దానికి చెందిన అనేక చారిత్రక విస్ఫోటనాలతో సహా అన్ని తదనంతర విస్ఫోటనాలు, వాన్ సీబాచ్ క్రేటర్ యొక్క ఇఎన్ఇ ఉన్న 500-మీటర్ల-వెడల్పు గల ఆమ్ల సరస్సును కలిగి ఉన్న ప్రముఖ క్రియాశీల బిలం నుండి వచ్చాయి.
ఈ అగ్నిపర్వతం యునెస్కో ప్రపంచ వారసత్వ సంపద అయిన ఏరియా డి కన్సర్వేసియోన్ గ్వానాకాస్టే లోపల ఉంది.[[వర్గం : అగ్నిపర్వతాలు]] [[ వర్గం : తెవికీ అగ్నిపర్వతాలు]][[వర్గం : క్రేటర్ ఆఫ్ రింకాన్ డి లా వీజ అగ్నిపర్వతాలు]] [[వర్గం : అగ్నిపర్వతాల జాబితా]]

