ఏడంస్ అనే పేరుగల అగ్నిపర్వతం కానడా అండ్ వెస్టర్న్ ఉసా ప్రాంతం,యునిటెడ్ స్టేట్స్ దేశంలో ఉంది.ఈ అగ్నిపర్వత సంఖ్య 321040.ఈ అగ్నిపర్వతం ప్రాథమిక రకం స్త్రతోవోల్కనో., అత్యంత ఇటీవలి విస్ఫోటనం 950 లో సంభవించింది.ఈ అగ్నిపర్వతం 46.206 డిగ్రీల అక్షాంశం మరియు -121.49 డిగ్రీల రేఖాంశం మద్యలో లో ఉంటుంది.ఈ అగ్నిపర్వతంసముద్ర మట్టానికి 3742 ఎత్తులో ఉంది.అందేసితే / బసల్టిక్ అందేసితే అనేది అగ్నిపర్వతం యొక్క ప్రాథమిక శిల.బసల్ట్ / పిక్క్రో-బసల్ట్ నాన్ నాన్ దాసితేఅనే శిలలు తరువాతి అత్యంత ముఖ్యమైనవి.ఏడంస్ అగ్నిపర్వతం నుండి ఐదు కిలోమీటర్ల వ్యవధిలో ఉన్న జనాబ సుమారు 0.0.ఏడంస్ అగ్నిపర్వతం నుండి పది కిలోమీటర్ల వ్యవధిలో ఉన్న జనాబ సుమారు 70.0.ఏడంస్ అగ్నిపర్వతం ముప్పై కిలోమీటర్ల పరిధిలో సుమారు 4019.0 మంది జనాభాను కలిగి ఉంది.ఏడంస్ అగ్నిపర్వతం వంద కిలోమీటర్ల పరిధిలో సుమారు 393303.0 మంది జనాభాను కలిగి ఉంది.ఈ అగ్నిపర్వతం యొక్క భౌగోళిక గతం ఉత్తరాన దాని పొరుగున ఉన్న మౌంట్ రైనియర్ కంటే తక్కువ ఎత్తులో ఉన్నప్పటికీ, మౌంట్ ఆడమ్స్ ఒక దిగువ టోపోగ్రాఫిక్ బేస్ పైన పెరుగుతుంది మరియు కాస్కేడ్ రేంజ్ లోని మౌంట్ శాస్తా తరువాత మాత్రమే వాల్యూమ్ లో రెండవ స్థానంలో ఉంది. అగ్నిపర్వత క్షేత్రంలో 200 కి.మీ.3 మౌంట్ ఆడమ్స్ కాంప్లెక్స్ ఆండిసిటిక్-డాసిటిక్ స్ట్రాటోవోల్కానో, ఎన్.ఎన్.డబ్ల్యు-ఎస్.ఎస్.ఇ రేఖ వెంబడి విస్తరించి, 60 కి.మీ కంటే ఎక్కువ పార్శ్వ వెంట్స్ ఉన్నాయి. వోల్కానిజం సుమారు 940 కా. లో ప్రారంభమైంది, మూడు ప్రధాన శంఖువు-నిర్మాణ దశలు సుమారు 500, 450, మరియు 30 కా వద్ద సంభవించాయి. ఇది హోలోసీన్ అంతటా చురుకుగా ఉంది, శిఖరం మరియు పార్శ్వ వెంట్స్ నుండి రెండు డజన్ల చిన్న పేలుడు విస్ఫోటనాలను ఉత్పత్తి చేసింది. ఆరు హోలోసీన్ లావా ప్రవాహాలు 2100 మరియు 2600 మీటర్ల ఎత్తు మధ్య పార్శ్వాలపై ఉన్నాయి. అత్యంత భారీ హోలోసీన్ లావా ప్రవాహాలు, వీటిలో కొన్ని 10 కిలోమీటర్లు లేదా అంతకంటే ఎక్కువ ప్రయాణించాయి, సుమారు 7 మరియు 4 కా మధ్య ఉన్నాయి. సుమారు 1000 సంవత్సరాల క్రితం తాజా విస్ఫోటనం ఒక చిన్న టెఫ్రా పొరను మరియు బహుశా E పార్శ్వం నుండి ఒక చిన్న లావా ప్రవాహాన్ని ఉత్పత్తి చేసింది.[[వర్గం : అగ్నిపర్వతాలు]] [[ వర్గం : తెవికీ అగ్నిపర్వతాలు]][[వర్గం : స్త్రతోవోల్కనో అగ్నిపర్వతాలు]] [[వర్గం : అగ్నిపర్వతాల జాబితా]]

