ఏడంస్ సీమౌంట్ , హవాయి అండ్ పాసిఫిక్ ఆకాన్ ప్రాంతం,ఉండర్సీ ఫిటర్స్ దేశంలో ఉన్న అగ్నిపర్వతం.333050 ఈ అగ్నిపర్వత సంఖ్య.దీని ప్రధాన రకం సుబ్మరిన్.ఈ ఏడంస్ సీమౌంట్ అగ్నిపర్వతం చివరిసారిగా -50 లో విస్ఫోటనం చెందింది.ఈ అగ్నిపర్వతం -25.37 డిగ్రీల అక్షాంశం మరియు -129.27 డిగ్రీల రేఖాంశంలో ఉంది.ఈ అగ్నిపర్వతంసముద్ర మట్టానికి -39 ఎత్తులో ఉంది.ఈ అగ్నిపర్వతం యొక్క ప్రాధమిక శిల బసల్ట్ / పిక్క్రో-బసల్ట్. ట్రేచిబాసాల్ట్ / తెఫ్రిటే బసానిట్ త్రచ్యతే / ట్రాచిడాసిట్ నాన్ త్రాచ్యందేశితేసితే / బసల్టిక్ త్రాచ్యందేశితేసితేతరువాతి అత్యంత ముఖ్యమైన శిలలు.ఈ అగ్నిపర్వత ఇతర శిలలు అందేసితే / బసల్టిక్ అందేసితే నాన్.ఏడంస్ సీమౌంట్ అగ్నిపర్వతం ఐదు కిలోమీటర్ల పరిధిలో సుమారు 0.0 మంది జనాభాను కలిగి ఉంది.ఏడంస్ సీమౌంట్ అగ్నిపర్వతం నుండి పది కిలోమీటర్ల వ్యవధిలో ఉన్న జనాబ సుమారు 0.0.ఏడంస్ సీమౌంట్ అగ్నిపర్వతం నుండి ముప్పై కిలోమీటర్ల వ్యవధిలో ఉన్న జనాబ సుమారు 0.0.ఏడంస్ సీమౌంట్ అగ్నిపర్వతం నుండి వంద కిలోమీటర్ల వ్యవధిలో ఉన్న జనాబ సుమారు 44.0.ఈ అగ్నిపర్వతం యొక్క భౌగోళిక గతం పిట్కేర్న్ ద్వీపానికి సుమారు 90 కి.మీ.ల డబ్ల్యు.ఎస్.డబ్ల్యు.ల దూరంలో ఉన్న మధ్య పసిఫిక్ ప్రాంతంలోని పిట్కేర్న్ హాట్ స్పాట్ పైన ఆడమ్స్ సీమౌంట్ నిర్మించబడింది. పిట్కేర్న్ హాట్ స్పాట్ బౌంటీ సీమౌంట్ లోపల ఉన్న మరో పెద్ద జలాంతర్గామి అగ్నిపర్వతం యొక్క సుమారు 25 కిలోమీటర్ల ఎస్డబ్ల్యు సముద్ర ఉపరితలం నుండి 59 మీటర్ల లోపు భారీ సముద్రమట్టం 3500 మీటర్ల నుండి 59 మీటర్ల లోపలకు పెరుగుతుంది. పిట్కేర్న్ హాట్ స్పాట్ 30 మిలియన్ సంవత్సరాల పురాతన పసిఫిక్ మహాసముద్ర క్రస్ట్ మీద నిర్మించబడింది, మరియు రెండు పెద్ద అగ్నిపర్వతాలకు అదనంగా ఆడమ్స్ మరియు బౌంటీ సీమౌంట్స్, సుమారు 500 మీటర్ల ఎత్తులో సుమారు 20 చిన్న అగ్నిపర్వత కొండలను కలిగి ఉన్నాయి. సముద్ర ఉపరితలానికి 450 మీటర్ల లోపలకు పెరిగే బౌంటీ సీమౌంట్, ఆడమ్స్ కంటే స్వరూపపరంగా మరింత యవ్వనంగా కనిపించినప్పటికీ మరియు నీటి నమూనాలు నిరంతర జల ఉష్ణ చర్యను సూచిస్తున్నాయి, రెండు చివరి-ప్లైస్టోసీన్ పొటాషియం-ఆర్గాన్ తేదీలు సుమారు 338,000 మరియు 350,000 సంవత్సరాల బౌంటీ యొక్క పార్శ్వాల నుండి పొందబడ్డాయి. ఆల్కలీ బసాల్టిక్ శిలలు ఆడమ్స్ సీమౌంట్ యొక్క పార్శ్వాల నుండి డ్రెడ్జింగ్ చేయబడ్డాయి, దీని శిఖరం ట్రాచిటిక్ లావా గోపురం కలిగి ఉన్నట్లు కనిపిస్తుంది. హోలోసీన్ యుగానికి చెందిన అనేక పొటాషియం-ఆర్గాన్ తేదీలు ఆడమ్స్ సీమౌంట్ (గిల్లౌ ఎట్ అల్., 1997) వద్ద డ్రెడ్జ్ ల నుండి పొందబడ్డాయి, వీటిలో అతి పిన్న వయస్కుడు 2000 +/- 1000 సంవత్సరాలు.[[వర్గం : అగ్నిపర్వతాలు]] [[ వర్గం : తెవికీ అగ్నిపర్వతాలు]][[వర్గం : సుబ్మరిన్ అగ్నిపర్వతాలు]] [[వర్గం : అగ్నిపర్వతాల జాబితా]]

