ఆదతరాయముడు , జపాన్, తైవాన్, మరియనాస్ ప్రాంతం,జపాన్ దేశంలో ఉన్న అగ్నిపర్వతం.283170 ఈ అగ్నిపర్వత సంఖ్య.ఈ అగ్నిపర్వతం ప్రాథమిక రకం స్త్రతోవోల్కనో(ఎస్).ఈ అగ్నిపర్వతం నుండి చివరగ వెలువడిన విస్ఫోటనం 1996 సంవత్సరంలో జరిగింది.ఈ అగ్నిపర్వతం 37.647 డిగ్రీల అక్షాంశం మరియు 140.281 డిగ్రీల రేఖాంశంలో ఉంది.సముద్ర మట్టానికి 1728 మీటర్ల ఎత్తులో ఈ అగ్నిపర్వతం ఉంది.అందేసితే / బసల్టిక్ అందేసితే అనేది అగ్నిపర్వతం యొక్క ప్రాథమిక శిల.ఆదతరాయముడు అగ్నిపర్వతం ఐదు కిలోమీటర్ల పరిధిలో సుమారు 3936.0 మంది జనాభాను కలిగి ఉంది.ఆదతరాయముడు అగ్నిపర్వతం పది కిలోమీటర్ల పరిధిలో సుమారు 717078.0 మంది జనాభాను కలిగి ఉంది.ఆదతరాయముడు అగ్నిపర్వతం ముప్పై కిలోమీటర్ల పరిధిలో సుమారు 5024654.0 మంది జనాభాను కలిగి ఉంది.ఈ అగ్నిపర్వతం యొక్క భౌగోళిక చరిత్ర ఫుకుషిమా నగరానికి సుమారు 15 కి.మీ.ల దూరంలో ఉన్న బందాయ్ అగ్నిపర్వతం యొక్క ఇ., అడతరాయ అగ్నిపర్వతం యొక్క విశాలమైన అటవీ మాసిఫ్ ఉంది. ఇది దక్షిణం మీద టెరిటరీ శిలలు మరియు ఉత్తరాన అజుమయామా అగ్నిపర్వతం పైన పైకి లేచే ఆధిపత్య ఆండిసిటిక్ స్ట్రాటోవోల్కానోలు మరియు లావా గోపురాల సమూహాన్ని కలిగి ఉంది. సుమారు 550,000, 350,000, మరియు 200,000 సంవత్సరాల క్రితం ప్రారంభమైన మూడు ప్రధాన దశలలో నిర్మాణం జరిగింది. కాంప్లెక్స్ యొక్క ఎత్తైన ప్రదేశం 1728-మీ-ఎత్తు మినోవాసన్, టెట్సుజాన్ కు ఉత్తరాన ఒక గోపురం ఆకారపు స్ట్రాటోవోల్కానో, ప్రస్తుతం క్రియాశీలంగా ఉన్న స్ట్రాటోవోల్కానో. నుమనోటైరా, చురుకైన శిఖరాగ్ర బిలం, వేడి నీటి బుగ్గలు మరియు ఫ్యూమరోల్స్ తో చుట్టుముట్టబడి పశ్చిమాన అయోగావా నది ("సల్ఫర్ నది") ద్వారా విచ్ఛిన్నం చేయబడుతుంది. 1900 లో ఒక విస్ఫోటనం సమయంలో శిఖరాగ్ర క్రేటర్ లోని ఒక సల్ఫర్ గని యొక్క డెబ్బై రెండు మంది కార్మికులు మరణించారు. చారిత్రక విస్ఫోటనాలు 1.2 కి.మీ-వెడల్పు, 350-మీ-లోతు గల నుమోనోటైరా బిలానికి పరిమితం చేయబడ్డాయి.[[వర్గం : అగ్నిపర్వతాలు]] [[ వర్గం : తెవికీ అగ్నిపర్వతాలు]][[వర్గం : స్త్రతోవోల్కనో(ఎస్) అగ్నిపర్వతాలు]] [[వర్గం : అగ్నిపర్వతాల జాబితా]]



