ఈ అగ్నిపర్వతం పేరు అదమస్.ఈ అగ్నిపర్వత సంఖ్య 212030.ఈ అగ్నిపర్వతాన్ని థర్మల్ ఆఫ్ మీíలాస్ అగ్నిపర్వతంగా వర్గీకరిస్తారు.ఈ అగ్నిపర్వతం యొక్క  భౌగోళిక చరిత్ర మైలోస్ మరియు ప్రక్కనే ఉన్న చిన్న ద్వీపాలు జలాంతర్గామి మరియు సుబేరియల్ వోల్కానిజం నుండి ఉద్భవించాయి, ఇది ప్రారంభంలో ఆధిక్యతగా ఆండిసిటిక్ మరియు బసాల్టిక్ గా ఉంది, కానీ ప్రధానంగా రైయోలిటిక్ విస్ఫోటనాలతో ముగిసింది. పురాతన అగ్నిపర్వత శిలలు ప్లయోసీన్ జలాంతర్గామి రైరోక్లాస్టిక్-ప్రవాహ నిక్షేపాలు నేలమాళిగ రూపాంతర మరియు అవక్షేప శిలలను అధిగమించాయి. చివరి ప్లైస్టోసీన్ కాలంలో జరిగిన తాజా కార్యకలాపం తక్కువ, యు-ఆకారంలో ఉన్న మైలోస్ ద్వీపం యొక్క తూర్పు సగభాగంలో కేంద్రీకృతమై, లావా గోపురాలు మరియు ఫ్రెయాటిక్ విస్ఫోటన బిలాలను ఏర్పరుస్తుంది, మరియు యాంటిమిలోస్ ద్వీపం నుండి ఎన్ డబ్ల్యు వరకు, ఇక్కడ ఒక మిశ్రమ అగ్నిపర్వతం నిర్మించబడింది. అతి పిన్న వయస్కుడైన మాగ్మాటిక్ విస్ఫోటనాలు సుమారు 90,000 సంవత్సరాల క్రితం జరిగాయి, కానీ ఫ్రేటిక్ విస్ఫోటనాలు, సాధారణంగా 1 కి.మీ కంటే ఎక్కువ వ్యాసం ఉన్న అతివ్యాప్తి చెందే క్రేటర్లను ఉత్పత్తి చేస్తాయి, చివరి-ప్లైస్టోసీన్ నుండి ఇటీవలి కాలం వరకు కొనసాగాయి. ఫైరిప్లాకా టఫ్ రింగ్ కు తూర్పున ఉన్న ఎస్ ఈ మిలోస్ లో ఒక లాహర్ నిక్షేపం, ఒక రోమన్ నౌకాశ్రయ పట్టణం యొక్క గోడలను పూడ్చిపెట్టి, ఒక ముతక బూడిద పొరను కప్పివేస్తుంది, మరియు నేలమాళిగ రాళ్ల ద్వారా ఒక చిన్న ఫ్రెయాటిక్ విస్ఫోటనం నుండి ఉద్భవించిందని భావించబడింది.[[వర్గం : అగ్నిపర్వతాలు]]
