అదిక-విలిస్ , నాన్ ప్రాంతం,ఇండోనేషియా దేశంలో ఉన్న అగ్నిపర్వతం.ఈ అగ్నిపర్వత సంఖ్య 263270.దీని ప్రధాన రకం స్ట్రాటోవాక్కానాస్.ఈ అగ్నిపర్వతం యొక్క భౌగోళిక చరిత్ర గునుంగ్ విలిస్ అనేది ఒక ఏకాంత అగ్నిపర్వత మాసిఫ్, దాని దక్షిణం వైపు తప్ప మిగిలిన అన్నింటిలో తక్కువ-ఎత్తైన మైదానాలతో చుట్టుముట్టబడింది. ఇది ప్లైస్టోసీన్ మధ్య కాలం నాటి మూడు ఎపిసోడ్లలో ఏర్పడింది. 2 వ భవనం నాశనమైన తరువాత, హోలోసీన్ సమయంలో అత్యంత ఇటీవలి శంఖువు పెరిగింది. క్రీ.శ. 1641లో ఒక విస్ఫోటనం జరిగినట్లు ఒక నివేదిక ఉన్నప్పటికీ, అదే సంవత్సరం సమీపంలోని కెలుట్ యొక్క ప్రధాన విస్ఫోటనం సంభవించినప్పటికీ, ధృవీకరించబడిన చారిత్రక విస్ఫోటనాలు ఏవీ తెలియవు. ఫుమరోల్స్ మరియు మట్టి కుండలు దిగువ పశ్చిమ వైపున ఉన్న న్గెబెల్ సరస్సు సమీపంలో సంభవిస్తాయి.[[వర్గం : అగ్నిపర్వతాలు]] [[ వర్గం : తెవికీ అగ్నిపర్వతాలు]][[వర్గం : స్ట్రాటోవాక్కానాస్ అగ్నిపర్వతాలు]] [[వర్గం : అగ్నిపర్వతాల జాబితా]]

