అద్వా అనే పేరుగల అగ్నిపర్వతం ఆఫ్రికా అండ్ రీడ్ సీ ప్రాంతం,ఎథియోపియా దేశంలో ఉంది.ఈ అగ్నిపర్వత సంఖ్య 221170.దీని ప్రధాన రకం స్త్రతోవోల్కనో., అత్యంత ఇటీవలి విస్ఫోటనం 1928 లో సంభవించింది.ఈ అగ్నిపర్వతం 10.063 డిగ్రీల అక్షాంశం మరియు 40.831 డిగ్రీల రేఖాంశంలో ఉంది.ఈ అగ్నిపర్వతం యొక్క శిఖరం సముద్ర మట్టానికి 1670 మీటర్ల ఎత్తులో ఉంది.ర్యోలిట్ అనేది అగ్నిపర్వతం యొక్క ప్రాథమిక శిల.బసల్ట్ / పిక్క్రో-బసల్ట్ త్రచ్యతే / ట్రాచిడాసిట్ నాన్ నాన్తరువాతి అత్యంత ముఖ్యమైన శిలలు.అద్వా అగ్నిపర్వతం నుండి ఐదు కిలోమీటర్ల వ్యవధిలో ఉన్న జనాబ సుమారు 101.0.అద్వా అగ్నిపర్వతం నుండి పది కిలోమీటర్ల వ్యవధిలో ఉన్న జనాబ సుమారు 485.0.అద్వా అగ్నిపర్వతం ముప్పై కిలోమీటర్ల పరిధిలో సుమారు 18645.0 మంది జనాభాను కలిగి ఉంది.అద్వా అగ్నిపర్వతం వంద కిలోమీటర్ల పరిధిలో సుమారు 1242922.0 మంది జనాభాను కలిగి ఉంది.ఈ అగ్నిపర్వతం యొక్క భౌగోళిక చరిత్ర అడ్వా (అబిడా, అమోయిస్సా, లేదా దబిటా అని కూడా పిలుస్తారు), ఇది చిన్న శాఖీయ అయేలు అగ్నిపర్వతానికి తూర్పున ఉన్న దక్షిణ అఫార్ ప్రాంతంలో ఒక విశాలమైన స్ట్రాటోవోల్కానో. ఇది సుమారు 3 x 4 కి.మీ కాల్డెరాను కలిగి ఉంది, ఇది భారీ ఇగ్నింబ్రైట్ల విస్ఫోటనం తరువాత ఉద్భవించింది, కాల్డెరా యొక్క తూర్పు భాగంలో ఒక ట్రాకైటిక్ గోపురం బహిర్గతం చేయబడింది. స్కోరియా కోన్ లు కాల్డెరా యొక్క ఫ్లోర్ మీద మరియు దాని యొక్క NW మరియు SW పార్శ్వాలపై ఉంటాయి. విస్తృతమైన యువ బసాల్టిక్ లావా ప్రవాహాలు పార్శ్వాలను కప్పివేస్తాయి మరియు ఎస్ఇకి అవక్షేప మైదానాన్ని అతివ్యాప్తి చేస్తాయి. కాల్డెరా లోపల అనేక ఫ్యూమరోల్స్ సంభవిస్తాయి. సాటెల్లిటిక్ పైరోక్లాస్టిక్ శంకువులు మరియు లావా గోపురాలు కొన్ని వందల సంవత్సరాల నాటివిగా మాత్రమే పరిగణించబడ్డాయి (మొహర్ 1980, పెర్స్. కామ్.). ఎస్ డబ్ల్యు ఫ్లాంక్ మీద కాల్డెరా రిమ్ నుండి సుమారు 4 కిలోమీటర్ల దూరంలో ఉన్న శంఖువుల నుండి ఉద్భవించే డార్క్ లావా ప్రవాహాలు 50 చ.కి.మీ 2 కంటే ఎక్కువ కవర్ అవుతాయి.[[వర్గం : అగ్నిపర్వతాలు]] [[ వర్గం : తెవికీ అగ్నిపర్వతాలు]][[వర్గం : స్త్రతోవోల్కనో అగ్నిపర్వతాలు]] [[వర్గం : అగ్నిపర్వతాల జాబితా]]



