ఈ అగ్నిపర్వతం పేరు ఏక్ మదురణ.ఈ అగ్నిపర్వత సంఖ్య 261110.ఈ అగ్నిపర్వతాన్ని థర్మల్ ఆఫ్ సిబుల్బుల్బలీ అగ్నిపర్వతంగా వర్గీకరిస్తారు.[[వర్గం : అగ్నిపర్వతాలు]]
    [[ వర్గం : తెవికీ అగ్నిపర్వతాలు]][[వర్గం : థర్మల్ ఆఫ్ సిబుల్బుల్బలీ అగ్నిపర్వతాలు]]
    [[వర్గం : అగ్నిపర్వతాల జాబితా]]



	{{Infobox mountain
