ఈ అగ్నిపర్వతం పేరు ఏర్షన్.ఈ అగ్నిపర్వత సంఖ్య 305011.ఈ అగ్నిపర్వతం ప్రాథమిక రకం కోన్ - క్రేటర్ ఆఫ్ ఆర్క్సన్-చైహే.ఈ అగ్నిపర్వతం యొక్క భౌగోళిక చరిత్ర ఎన్ ఈ చైనాలోని ఇన్నర్ మంగోలియాలోని సెంట్రల్ డా హింగన్ పర్వతాలలో ఉన్న ఆర్క్సాన్-చైహే అగ్నిపర్వత క్షేత్రంలో కనీసం 27 అగ్నిపర్వత లక్షణాలు ఉన్నాయి. యాన్షాన్ మరియు గావోషాన్ లతో సహా అతి చిన్న శంకువులు బసాల్టిక్ లావా ప్రవాహాలను ఉత్పత్తి చేశాయి, ఇవి హలాహలే నది యొక్క డ్రైనేజీలను అడ్డుకున్నాయి మరియు ఆరు లావా-ఆనకట్టలతో కూడిన సరస్సులను సృష్టించాయి. రేడియోకార్బన్ సుమారు 2000-1900 సంవత్సరాల క్రితం స్కోరియా నిక్షేపాల డాక్యుమెంట్ విస్ఫోటనాల నుండి వచ్చింది. యాన్షాన్ శంఖువు సుమారు 362 మీటర్ల ఎత్తు, గావోషాన్ యొక్క బిలం 140 మీటర్ల లోతు ఉంటుంది. ఈ ప్రాంతాన్ని నేషనల్ జియోపార్క్ గా గుర్తించారు.
ఈ అగ్నిపర్వతం యునెస్కో గ్లోబల్ జియోపార్క్ ప్రాపర్టీ అయిన ఆర్క్సాన్ లోపల ఉంది.[[వర్గం : అగ్నిపర్వతాలు]] [[ వర్గం : తెవికీ అగ్నిపర్వతాలు]][[వర్గం : కోన్ - క్రేటర్ ఆఫ్ ఆర్క్సన్-చైహే అగ్నిపర్వతాలు]] [[వర్గం : అగ్నిపర్వతాల జాబితా]]



	{{Infobox mountain
	|name   = ఏసేపుత్ వేరో

	}}

ఈ అగ్నిపర్వతం పేరు ఏసేపుత్ వేరో.ఈ అగ్నిపర్వత సంఖ్య 266030.దీని ప్రధాన రకం డోమ్ ఆఫ్ సోపుటన్.ఈ అగ్నిపర్వతం యొక్క  భౌగోళిక గతం సులవేసి ద్వీపం యొక్క ఉత్తర భుజం మీద క్వాటర్నరీ టోండనో కాల్డెరా యొక్క దక్షిణ అంచున ఉన్న సోపుటాన్ స్ట్రాటోవోల్కానో సులవేసి యొక్క అత్యంత చురుకైన అగ్నిపర్వతాలలో ఒకటి. యువ, ఎక్కువగా వెజిటేటెడ్ అగ్నిపర్వతం రిండెంగన్-సెంపు యొక్క ఎస్ డబ్ల్యు ఉంది, దీనిని కొంతమంది కార్మికులు సోపుటాన్ మరియు మానింపోరోక్ (3.5 కి.మీ ES) అగ్నిపర్వత సముదాయంగా చేర్చారు. ఇది ఎస్ఎస్డబ్ల్యు-ఎన్ఎన్ఈ ట్రెండింగ్ లైన్ ఆఫ్ వెంట్స్ యొక్క దక్షిణ చివరలో నిర్మించబడింది. చారిత్రక సమయంలో విస్ఫోటనాల లోకస్ శిఖరాగ్ర క్రేటర్ మరియు ఏస్పుట్ రెండింటినీ కలిగి ఉంది, ఇది 1906 లో ఏర్పడిన ఒక ప్రముఖ NE-పార్శ్వ వెంట్ మరియు 1924 వరకు అడపాదడపా ప్రధాన లావా ప్రవాహాలకు మూలంగా ఉంది.[[వర్గం : అగ్నిపర్వతాలు]]
    [[ వర్గం : తెవికీ అగ్నిపర్వతాలు]][[వర్గం : డోమ్ ఆఫ్ సోపుటన్ అగ్నిపర్వతాలు]]
    [[వర్గం : అగ్నిపర్వతాల జాబితా]]



