ఈ అగ్నిపర్వతం పేరు ఆఫనా.ఈ అగ్నిపర్వత సంఖ్య 244050.ఈ అగ్నిపర్వతాన్ని క్రేటర్ - కోన్ ఆఫ్ వాలిస్ ఇస్లాండ్స్ అగ్నిపర్వతంగా వర్గీకరిస్తారు.ఈ అగ్నిపర్వతం యొక్క  భౌగోళిక గతం వాలిస్ ద్వీపాలు సాపేక్షంగా ఒక పెద్ద ద్వీపం, 7 x 14 కి.మీ. యువియా ద్వీపం, మరియు 22 చిన్న ద్వీపాలు మరియు ద్వీపాలను కలిగి ఉన్నాయి, ఇవి ఒక అడ్డంకి దిబ్బతో చుట్టుముట్టబడి ఉన్నాయి. తక్కువ అటవీ ద్వీపాలు, విస్ఫోటన క్రేటర్ల ద్వారా కత్తిరించబడిన చదునైన బసాల్టిక్ లావా ప్రవాహాలతో ఏర్పడినవి, టఫ్ కోన్లు మరియు సిండర్ కోన్లచే కప్పబడి ఉంటాయి. అనేక చిన్న కవచాలు (లావా శంకువులు) మరియు టఫ్ శంకువులు ప్లైస్టోసీన్ నుండి ఇటీవలి కాలం వరకు (స్టీర్న్స్, 1945) చెందినవిగా రూపశాస్త్ర ప్రాతిపదికన పరిగణించబడతాయి. నాటి నమూనాల యొక్క పొటాషియం-ఆర్గాన్ యుగాలు 0.5 నుండి 0.08 మిలియన్ సంవత్సరాల వయస్సు వరకు ఉంటాయి, కానీ ప్లైస్టోసీన్ లేదా హోలోసీన్ యుగానికి చెందిన శిలలు ఉన్నాయి (ప్రైస్ ఎట్ అల్., 1991).[[వర్గం : అగ్నిపర్వతాలు]]
