ఈ అగ్నిపర్వతం పేరు అఫతే, సెర్రో.ఈ అగ్నిపర్వత సంఖ్య 343041.ఈ అగ్నిపర్వతాన్ని డోమ్ ఆఫ్ కోటెప్కుడు కాల్డీరా అగ్నిపర్వతంగా వర్గీకరిస్తారు.ఈ అగ్నిపర్వతం యొక్క  భౌగోళిక చరిత్ర 7 x 10 కి.మీ. కోటెపెక్యూ కాల్డెరా, దాని తూర్పు వైపున కాల్డెరా సరస్సుతో నిండి ఉంది, శాంటా అనా అగ్నిపర్వతం యొక్క వెంటనే E యొక్క స్ట్రాటోవోల్కనోల సమూహం కూలిపోవడం ద్వారా ఏర్పడింది. కాల్డెరా రిమ్ యొక్క ఎత్తు దాని W వైపున పెరుగుతుంది, అక్కడ ఇది శాంటా అనాను పాక్షికంగా కత్తిరించుతుంది. ~72,000 మరియు 51,000 సంవత్సరాల క్రితం పెద్ద రైయోలిటిక్ పేలుడు విస్ఫోటనాల పరంపర సమయంలో కాల్డెరా ఏర్పడింది. కాల్డెరా అనంతర విస్పోటనాలు, కాల్డెరా యొక్క పశ్చిమ అంచుకు సమీపంలో బసాల్టిక్ సిండర్ కోన్లు మరియు లావా ప్రవాహాలు ఏర్పడటం మరియు కాల్డెరా సరస్సు అంచులకు సమీపంలో ఎన్ఈ-ఎస్డబ్ల్యు లైన్ వెంబడి అరడజను రైయోడాసిటిక్ లావా గోపురాలను బహిర్గతం చేయడం వంటివి ఉన్నాయి. గోపురాలలో ఎత్తైనది ఇస్లా డి కాబ్రా, లేదా సెర్రో గ్రాండే అనే అడవి ద్వీపాన్ని ఏర్పరుస్తుంది. గోపురాల యొక్క వయస్సు ఖచ్చితంగా తెలియదు, కానీ చిన్న గోపురం, సెర్రో పాచో, 10,000 సంవత్సరాల కంటే తక్కువ కాలం క్రితం ఏర్పడిందని అంచనా వేయబడింది. సరస్సు అంచులకు సమీపంలో వేడి నీటి బుగ్గలు ఏర్పడతాయి, కానీ ధృవీకరించబడిన చారిత్రక విస్ఫోటనాలు సంభవించలేదు.[[వర్గం : అగ్నిపర్వతాలు]]
    [[ వర్గం : తెవికీ అగ్నిపర్వతాలు]][[వర్గం : డోమ్ ఆఫ్ కోటెప్కుడు కాల్డీరా అగ్నిపర్వతాలు]]
    [[వర్గం : అగ్నిపర్వతాల జాబితా]]

{{Infobox mountain |name = ఆఫ్డరా |elevation_m =1250. |coordinates =అక్షాంశం :13.088, రేఖాంశం : 40.853 |location =ఆఫ్రికా అండ్ రీడ్ సీ,ఎథియోపియా
}}
ఆఫ్డరా అనే పేరుగల అగ్నిపర్వతం ఆఫ్రికా అండ్ రీడ్ సీ ప్రాంతం,ఎథియోపియా దేశంలో ఉంది.ఈ అగ్నిపర్వత సంఖ్య 221110.ఈ అగ్నిపర్వతాన్ని స్త్రతోవోల్కనో అగ్నిపర్వతంగా వర్గీకరిస్తారు.ఈ అగ్నిపర్వతం 13.088 డిగ్రీల అక్షాంశం మరియు 40.853 డిగ్రీల రేఖాంశం మద్యలో లో ఉంటుంది.ఈ అగ్నిపర్వతంసముద్ర మట్టానికి 1250 ఎత్తులో ఉంది.ఈ అగ్నిపర్వతం యొక్క ప్రాధమిక శిల ర్యోలిట్. అందేసితే / బసల్టిక్ అందేసితే నాన్అనేవి ఇతర గుర్తించదగిన శిలలు.ఆఫ్డరా అగ్నిపర్వతం నుండి ఐదు కిలోమీటర్ల వ్యవధిలో ఉన్న జనాబ సుమారు 6042.0.ఆఫ్డరా అగ్నిపర్వతం పది కిలోమీటర్ల పరిధిలో సుమారు 8611.0 మంది జనాభాను కలిగి ఉంది.ఆఫ్డరా అగ్నిపర్వతం నుండి ముప్పై కిలోమీటర్ల వ్యవధిలో ఉన్న జనాబ సుమారు 161009.0.ఈ అగ్నిపర్వతం యొక్క భౌగోళిక చరిత్ర అఫ్డెరా అనేది ఎర్టా ఆలే, టాట్ అలీ, మరియు అలయిటా శ్రేణుల మధ్య ఉన్న ఒక వివిక్త రైయోలిటిక్ స్ట్రాటోవోల్కానో. ఇది మూడు ఫాల్ట్ సిస్టమ్ ల యొక్క కూడలి వద్ద ఉంటుంది. యువ రైయోలిటిక్ లావా గోపురాలు దాని దక్షిణ పాదం వద్ద ఎన్-ఎస్ ను సమలేఖనం చేస్తాయి. కొన్ని చివరి దశ సాటెల్లిటిక్ కోన్ లు మాత్రమే బసాల్టిక్ కూర్పుకు చెందినవి. విస్ఫోటనాలు 1907 మరియు 1915 లో నివేదించబడ్డాయి (కేటలాగ్ ఆఫ్ యాక్టివ్ వోల్కనోస్ ఆఫ్ ది వరల్డ్). అయితే, రూపశాస్త్ర కారణాల రీత్యా ఇది ప్రక్కనే ఉన్న అగ్నిపర్వతాల కంటే గణనీయంగా పురాతనమైనదిగా కనిపిస్తుంది, మరియు నివేదించబడ్డ విస్ఫోటనాలు బహుశా పశ్చిమాన ఉన్న అలైటా అగ్నిపర్వతం నుండి వచ్చి ఉండవచ్చు. పొటాషియం-ఆర్గాన్ పద్ధతి ప్రకారం ఎస్-ఫ్లాంక్ రైయోలిటిక్ లావా గోపురాలు చాలా చిన్నవిగా ఉన్నప్పటికీ, అత్యంత ఇటీవలి విస్ఫోటనం యొక్క వయస్సు తెలియదు.[[వర్గం : అగ్నిపర్వతాలు]] [[ వర్గం : తెవికీ అగ్నిపర్వతాలు]][[వర్గం : స్త్రతోవోల్కనో అగ్నిపర్వతాలు]] [[వర్గం : అగ్నిపర్వతాల జాబితా]]

{{Infobox mountain |name = ఆఫ్లిట్స్
}}
ఈ అగ్నిపర్వతం పేరు ఆఫ్లిట్స్.ఈ అగ్నిపర్వత సంఖ్య 382081.దీని ప్రధాన రకం కోన్ ఆఫ్ పికాస్ ఫిస్సరల్ వోల్‌కానిక్ సిస్టెం.ఈ అగ్నిపర్వతం యొక్క భౌగోళిక చరిత్ర పికోస్ అగ్నిపర్వత వ్యవస్థ యొక్క దాదాపు 200 స్కోరియా శంకువులు సెటే సిడాడెస్ మరియు అగువా డి పౌ అగ్నిపర్వతాల మధ్య సావో మిగ్యుల్ ద్వీపం యొక్క "నడుము" చుక్కలుగా ఉన్నాయి. ఈ మోనోజెనిటిక్ పగులు-నియంత్రిత, ఆధిపత్యంగా బసాల్టిక్ వోల్కానిజం, దీనిలో ఎక్కువ భాగం సుమారు 5000 సంవత్సరాల నాటి ఫోగో విస్ఫోటనం తరువాత తేదీలు, అగ్నిపర్వతానికి కేటాయించబడవు మరియు విరిగిన ప్రాంతాన్ని అధిగమించే ఎన్-ఎచెలాన్ పగుళ్లకు సంబంధించినవిగా కనిపిస్తాయి. పికోస్ అగ్నిపర్వత వ్యవస్థ నుండి ఉద్భవించినట్లు భావించబడుతున్న మందపాటి ప్యూమిస్ నిక్షేపాలు వెంట్స్ లేదా కాల్డెరా నుండి ఉద్భవించి ఉండవచ్చు మరియు ఇప్పుడు యువ బసాల్టిక్ వోల్కానిజం చేత నాశనం చేయబడి, ఖననం చేయబడి ఉండవచ్చు. యువ వెంట్స్ లో అత్యంత గుర్తించదగినది 485-మీటర్ల ఎత్తైన సెర్రా గోర్డా, సీట్ సిడాడెస్ యొక్క ఎస్ ఈ, మరియు అగువా డి పాల్ గ్రామానికి దక్షిణంగా లావా డెల్టాను ఉత్పత్తి చేసిన శంఖువు. సావో మిగ్యుల్ ద్వీపంలో నివసించేవారిలో అత్యధికులు ఈ అగ్నిపర్వత మండలానికి దిగువన ఉన్న రెండు తీరాలను ఆక్రమించారు. గత 2800 సంవత్సరాలలో కనీసం 18 విస్ఫోటనాలు సంభవించాయి, అయినప్పటికీ 1652 లో మాత్రమే చారిత్రాత్మక విస్ఫోటనం సంభవించింది. అత్యంత ఇటీవలి చర్య బసాల్టిక్ గా ఉంది, అయితే గత 1100 సంవత్సరాల్లో మరో రెండు పేలుడు ట్రాకైటిక్ విస్ఫోటనాలు సంభవించాయి.
ఈ అగ్నిపర్వతం యునెస్కో గ్లోబల్ జియోపార్క్ ప్రాపర్టీ అయిన అజోర్స్ లోపల ఉంది.[[వర్గం : అగ్నిపర్వతాలు]] [[ వర్గం : తెవికీ అగ్నిపర్వతాలు]][[వర్గం : కోన్ ఆఫ్ పికాస్ ఫిస్సరల్ వోల్‌కానిక్ సిస్టెం అగ్నిపర్వతాలు]] [[వర్గం : అగ్నిపర్వతాల జాబితా]]



