ఈ అగ్నిపర్వతం పేరు ఆఫోలు.ఈ అగ్నిపర్వత సంఖ్య 244030.దీని ప్రధాన రకం కోన్ ఆఫ్ ఉపోలు.ఈ అగ్నిపర్వతం యొక్క  భౌగోళిక గతం సమోవాలో 75 కిలోమీటర్ల పొడవైన ఉపోలు ద్వీపాన్ని ఏర్పరుస్తున్న భారీ, బసాల్టిక్ కవచం అగ్నిపర్వతం ఇ-డబ్ల్యు దిశలో విస్తరించి ఉంది మరియు ప్లియోసీన్ మరియు ప్లైస్టోసీన్ కాలంలో విస్తృతమైన విస్ఫోటనాల యొక్క రెండు కాలాలలో నిర్మించబడింది. ప్లైస్టోసీన్ కాలంలో అత్యంత విస్తృతమైన కార్యకలాపాలు ద్వీపం యొక్క మధ్య అక్షం వెంబడి 20 కిలోమీటర్ల సెగ్మెంట్ వెంబడి జరిగాయి. కోత యొక్క సుదీర్ఘ కాలం తరువాత, తాజా లావా ప్రవాహాలు, వాటిలో కనీసం మూడు వందల నుండి కొన్ని వేల సంవత్సరాల వయస్సు గలవిగా అంచనా వేయబడ్డాయి, దాని మధ్య మరియు పశ్చిమ వైపున ఉన్న ద్వీపం యొక్క శిఖరం దగ్గర ఉన్న వెంట్స్ నుండి విస్ఫోటనం చెందాయి (స్టీర్న్స్, 1944). అతి పిన్న వయస్కుడైన ప్రవాహాలలో ఒకటి వైలేలే బేకు తూర్పున సుమారు 1.5 కిలోమీటర్ల వెడల్పుతో ఉత్తర-మధ్య తీరానికి చేరుకోగా, మరొకటి లెఫాగా నది కాలువ గుండా ప్రయాణించి లెఫాగా బే వద్ద ఎస్ డబ్ల్యు తీరానికి చేరుకుంది. ఉపోలు యొక్క పశ్చిమ కొనలో ఉన్న అపోలిమా ద్వీపం ఒక హోలోసీన్ టఫ్ కోన్ ఒక పగడపు దిబ్బ ద్వారా అంచులు కలిగి ఉండటానికి చాలా చిన్నది, మరియు తీరం వెంబడి ఇతర రీఫ్-ఫ్రీ ప్రాంతాలు హోలోసీన్ లావా ప్రవాహాల ద్వారా ఏర్పడవచ్చు.[[వర్గం : అగ్నిపర్వతాలు]]
    [[ వర్గం : తెవికీ అగ్నిపర్వతాలు]][[వర్గం : కోన్ ఆఫ్ ఉపోలు అగ్నిపర్వతాలు]]
