ఈ అగ్నిపర్వతం పేరు ఆఫోనో.ఈ అగ్నిపర్వత సంఖ్య 244020.ఈ అగ్నిపర్వతాన్ని డోమ్ ఆఫ్ తుతూర అగ్నిపర్వతంగా వర్గీకరిస్తారు.ఈ అగ్నిపర్వతం యొక్క  భౌగోళిక చరిత్ర సమోవా ద్వీపాల మధ్యలో విస్తరించిన, విస్తృతంగా క్షీణించిన టుటుయిలా ద్వీపంలో ఎస్.ఎస్.డబ్ల్యు-ఎన్.ఎన్.ఇ ట్రెండింగ్ లో ఉన్న రెండు లేదా మూడు చీలికల వెంట నిర్మించిన ఐదు ప్లియోసీన్-టు-ప్లైస్టోసీన్ అగ్నిపర్వతాలు ఉన్నాయి. 32 కిలోమీటర్ల పొడవైన ద్వీపం మధ్యలో ఉన్న పాగో బసాల్టిక్-టు-ఆండిసిటిక్ షీల్డ్ అగ్నిపర్వతం దాని పశ్చిమాన పాగో పాగో నౌకాశ్రయాన్ని చుట్టుముట్టిన 9 కిలోమీటర్ల వెడల్పు గల కాల్డెరా ద్వారా కత్తిరించబడింది. కాల్డెరా ఇప్పుడు పాక్షికంగా సిండర్ కోన్ లు మరియు ట్రాకైటిక్ లావా గోపురాలతో నిండి ఉంది. ఈఎన్ఈ-ట్రెండింగ్ డైక్ కాంప్లెక్స్ లు పాగో అగ్నిపర్వతం మీద ప్రముఖంగా బహిర్గతమవుతాయి. సుదీర్ఘ కాలం కోత, మునిగిపోవడం మరియు ఒక అడ్డంకి దిబ్బ నిర్మాణం తరువాత, లియోన్ అగ్నిపర్వతాలు హోలోసీన్ సమయంలో 5 కిలోమీటర్ల పొడవైన ఎన్-ఎస్-ట్రెండింగ్ చీలిక వెంబడి ద్వీపం యొక్క దక్షిణ భాగంలో (స్టీర్న్స్, 1944) ఒక విశాలమైన ప్రాంతంపై విస్ఫోటనం చెందాయి, ఇది ప్రారంభంలో జలాంతర్గామి టఫ్ కోన్లు మరియు తదుపరి సుబేరియల్ సిండర్ కోన్ల సమూహాన్ని ఏర్పరచింది, ఇది తాజాగా కనిపించే పహోహో లావా ప్రవాహాలను ఉత్పత్తి చేసింది. ద్వీపంలోని ఎస్ డబ్ల్యు భాగంలో ఒక సాంస్కృతిక నిక్షేపాన్ని అతిక్రమించిన బూడిద పొర రేడియోకార్బన్ సుమారు 440 +/- 200 సిఈ (అడిసన్ ఎట్ అల్., 2006) నాటిది.[[వర్గం : అగ్నిపర్వతాలు]]
    [[ వర్గం : తెవికీ అగ్నిపర్వతాలు]][[వర్గం : డోమ్ ఆఫ్ తుతూర అగ్నిపర్వతాలు]]
