ఈ అగ్నిపర్వతం పేరు ఆఫోసా, మొంతñఅ డి.ఈ అగ్నిపర్వత సంఖ్య 383020.దీని ప్రధాన రకం పిరోక్లాస్టిక్టిక్ కోన్ ఆఫ్ హైర్రో.ఈ అగ్నిపర్వతం యొక్క భౌగోళిక గతం హియర్రో యొక్క త్రిభుజాకార ద్వీపం కానరీ ద్వీపాలలో అత్యధికంగా మరియు తక్కువగా అధ్యయనం చేయబడిన SW-గా గుర్తించబడుతుంది. సుమారు 1,30,000 సంవత్సరాల క్రితం ఎల్ గోల్ఫో అగ్నిపర్వతం యొక్క గురుత్వాకర్షణ పతనం ఫలితంగా ఏర్పడిన ఒక పెద్ద NW-ఫేసింగ్ ఎస్కార్ప్మెంట్ ద్వారా భారీ కవచం అగ్నిపర్వతం కత్తిరించబడింది. 12 కి.మీ వెడల్పు గల ఎల్ గోల్ఫో బేకు సరిహద్దుగా ఉన్న తక్కువ లావా ప్లాట్ఫారం పైన నిటారుగా ఉన్న స్కార్ప్ టవర్లు మరియు ఎస్.డబ్ల్యు మరియు ఎస్.ఇ.లకు మూడు ఇతర పెద్ద జలాంతర్గామి కొండచరియల నిక్షేపాలు ఉన్నాయి. ఎన్ డబ్ల్యు, ఎన్ ఈ, మరియు ఎస్ అనే మూడు ప్రముఖ రిఫ్ట్ లు ప్రముఖ టోపోగ్రాఫిక్ రిడ్జ్ లను ఏర్పరుస్తాయి. అగ్నిపర్వతం యొక్క సుబేరియల్ భాగం చదునైన క్వాటర్నరీ బసాల్టిక్ మరియు ట్రాచీబాసాల్టిక్ లావా ప్రవాహాలు మరియు అనేక యువ సిండర్ కోన్లు మరియు లావా ప్రవాహాలతో కప్పబడిన టఫ్ లను కలిగి ఉంటుంది. హోలోసీన్ శంకువులు మరియు ప్రవాహాలు బాహ్య పార్శ్వాలలో మరియు ఎల్ గోల్ఫో మాంద్యం రెండింటిలోనూ కనిపిస్తాయి. కానరీ ద్వీపాలలో యువ వెంట్స్ యొక్క అత్యధిక సాంద్రతను హియర్రో కలిగి ఉంది. అనిశ్చితి 1793 లో విస్ఫోటనం యొక్క నివేదికను చుట్టుముట్టింది. 2011-12లో ద్వీపం యొక్క దక్షిణ బిందువుకు 2 కిలోమీటర్ల దూరంలో జలాంతర్గామి విస్ఫోటనం సంభవించింది.
ఈ అగ్నిపర్వతం యునెస్కో గ్లోబల్ జియోపార్క్ ప్రాపర్టీ అయిన ఎల్ హియర్రోలో ఉంది.[[వర్గం : అగ్నిపర్వతాలు]] [[ వర్గం : తెవికీ అగ్నిపర్వతాలు]][[వర్గం : పిరోక్లాస్టిక్టిక్ కోన్ ఆఫ్ హైర్రో అగ్నిపర్వతాలు]] [[వర్గం : అగ్నిపర్వతాల జాబితా]]



