	}}

ఈ అగ్నిపర్వతం పేరు అఫుటిన.244040 ఈ అగ్నిపర్వత సంఖ్య.దీని ప్రధాన రకం కోన్ ఆఫ్ సవై'ఇ.ఈ అగ్నిపర్వతం యొక్క  భౌగోళిక గతం సమోవా దీవుల్లో అతి పెద్దది మరియు ఎత్తైనది అయిన సవాయి'ఐ, 75 కిలోమీటర్ల పొడవైన, ఓవల్-ఆకారంలో ఉన్న ద్వీపం యొక్క తూర్పు వైపున రెండు చీలికలుగా చీలిపోయిన డబ్ల్యుఎన్ డబ్ల్యు-ఈఎస్ఈ-ట్రెండింగ్ రిఫ్ట్ జోన్ వెంబడి నిర్మించిన భారీ బసాల్టిక్ కవచ అగ్నిపర్వతాన్ని కలిగి ఉంది. ప్లైయోసీన్ మరియు ప్లైస్టోసీన్ కవచం ఏర్పడటం తరువాత ప్రవాహం మరియు సముద్ర కోత, పాక్షిక మునిగిపోవడం మరియు పగడపు దిబ్బల పెరుగుదల జరిగింది. చివరి దశ ప్లైస్టోసీన్ మరియు హోలోసీన్ విస్ఫోటనాలు భారీ లావా ప్రవాహాలను ఉత్పత్తి చేశాయి, ఇవి అంచు దిబ్బలను పాక్షికంగా పాతిపెట్టాయి. అనేక సిండర్ శంకువులు మరియు లావా శంకువులు సవాయ్ యొక్క విశాలమైన శిఖరాన్ని చుక్కలు చేస్తాయి, ఇది తక్కువ-కోణం, గోపురం లాంటి ప్రొఫైల్ ను కలిగి ఉండి 1858 మీటర్ల ఎత్తుకు చేరుకుంటుంది. ఉత్తర-మధ్య పార్శ్వంలో అదనపు శంకువులు ఏర్పడతాయి, మరియు ద్వీపం యొక్క దక్షిణ-మధ్య భాగంలో పెద్ద సంఖ్యలో కనిపిస్తాయి. 20 వ శతాబ్దంలో రెండు సహా మూడు విస్ఫోటనాలు చారిత్రక కాలంలో సంభవించాయి, మరియు సుమారు 15 కిలోమీటర్ల వెడల్పు వరకు విశాలమైన ఫ్రంట్ ల వెంబడి ఉత్తర తీరానికి చేరుకున్న భారీ లావా ప్రవాహాలను ఉత్పత్తి చేశాయి, అనేక గ్రామాలను నాశనం చేశాయి మరియు అంచు దిబ్బలను అధిగమించాయి.[[వర్గం : అగ్నిపర్వతాలు]]
    [[ వర్గం : తెవికీ అగ్నిపర్వతాలు]][[వర్గం : కోన్ ఆఫ్ సవై'ఇ అగ్నిపర్వతాలు]]
