ఈ అగ్నిపర్వతం పేరు అజియోస్ జోన్నిస్.212050 ఈ అగ్నిపర్వత సంఖ్య.ఈ అగ్నిపర్వతం ప్రాథమిక రకం వెంట్ ఆఫ్ నిసిరోసిరోస్.ఈ అగ్నిపర్వతం యొక్క  భౌగోళిక గతం ఏజియన్ చాపం యొక్క తూర్పు అగ్నిపర్వతం 9-కిలోమీటర్ల వెడల్పు గల నిసిరోస్ ద్వీపాన్ని ఏర్పరుస్తుంది, ఇది 3-4 కిలోమీటర్ల వెడల్పు గల కాల్డెరాతో కత్తిరించబడింది. ఈ ద్వీపం గత 150,000 సంవత్సరాల కాలంలో నిర్మించబడింది, పేలుడు మరియు ఉత్తేజభరితమైన అండిసిటిక్ విస్ఫోటనాలతో సహా మూడు శంఖు-నిర్మాణ దశలు మరియు ఉత్సర్గ మరియు బహిర్గతమైన డాసిటిక్ మరియు రైయోలిటిక్ కార్యకలాపాలతో సహా. కాల్డెరా యొక్క వయస్సు వివిధ రకాలుగా <24,000 సంవత్సరాల ముందు (బిపి) (కెల్లర్ ఎట్ అల్., 1990) మరియు >44,000 బిపి (లింబర్గ్ మరియు వారెకాంప్, 1991) గా పరిగణించబడుతుంది. ఐదు పెద్ద కాల్డెరా అనంతర లావా గోపురాలు కాల్డెరా యొక్క పశ్చిమ భాగాన్ని పూర్తిగా నింపుతాయి. NE-most (బోరియాటికో) మరియు SW-మోస్ట్ (కరావియోటిస్) లావా గోపురాలు మరియు ప్రవాహాలు ఇతర గోపురాల కంటే గణనీయంగా చిన్నవిగా ఉంటాయి. ఎస్ డబ్ల్యు కాల్డెరా రిమ్ వెలుపల ఉన్న ఆరవ పోస్ట్ కాల్డెరా గోపురం, తీరానికి చేరుకున్న లావా ప్రవాహాలను ఉత్పత్తి చేసింది. 1422 మరియు 1888 మధ్యకాలంలో కాల్డెరాలోని క్రేటర్ల నుండి చారిత్రాత్మక ఫ్రేటిక్ విస్ఫోటనాలు సంభవించాయి. తీవ్రమైన హైడ్రోథర్మల్ యాక్టివిటీ కాల్డెరా ఫ్లోర్ పై అనేక ఫ్యూమరోల్స్ మరియు తీరం వెంబడి హాట్ స్ప్రింగ్ ల రూపంలో కొనసాగుతుంది.[[వర్గం : అగ్నిపర్వతాలు]]
    [[ వర్గం : తెవికీ అగ్నిపర్వతాలు]][[వర్గం : వెంట్ ఆఫ్ నిసిరోసిరోస్ అగ్నిపర్వతాలు]]
