ఈ అగ్నిపర్వతం పేరు అజియోస్ నికొలావాస్.212020 ఈ అగ్నిపర్వత సంఖ్య.ఈ అగ్నిపర్వతాన్ని థర్మల్ ఆఫ్ మేతన అగ్నిపర్వతంగా వర్గీకరిస్తారు.ఈ అగ్నిపర్వతం యొక్క  భౌగోళిక చరిత్ర మెథానా అగ్నిపర్వతం ఒక బసాల్టిక్-ఆండిసైట్ నుండి రైయోడాసిటిక్ లావా డోమ్ కాంప్లెక్స్ ను కలిగి ఉంది, ఇది పెలోపొన్నెసస్ యొక్క NE వైపున సార్రోనియన్ గల్ఫ్ లో మీథానా ద్వీపకల్పాన్ని ఏర్పరుస్తుంది. పొటాషియం-ఆర్గాన్ సంక్లిష్టత యొక్క పాత భాగానికి వయస్సు 900,000 నుండి 550,000 సంవత్సరాల వరకు ఉంటుంది, అయినప్పటికీ ప్లియోసీన్ చివరి కాలంలో కార్యకలాపాలు ప్రారంభమై ఉండవచ్చు. సుమారు 380,000-290,000 సంవత్సరాల క్రితం నుండి ఒక చిన్న దశ కార్యకలాపాలు జరిగాయి, ఇది లావా గోపురాలు మరియు ప్రవాహాల శ్రేణిని ఏర్పరుస్తుంది. ద్వీపకల్పం యొక్క ఎన్ డబ్ల్యు వైపున ఉన్న అతి పిన్న వయస్కుడైన గోపురం, కమెనో వూనో, క్రీ.పూ 3 వ శతాబ్దంలో ఏర్పడింది మరియు తీరానికి 500 మీటర్ల దూరంలో ప్రయాణించిన లావా ప్రవాహాన్ని ఉత్పత్తి చేసింది. ద్వీపకల్ప తీరం వెంబడి అనేక ప్రదేశాలలో వేడి నీటి బుగ్గలు కనిపిస్తాయి.[[వర్గం : అగ్నిపర్వతాలు]]
    [[ వర్గం : తెవికీ అగ్నిపర్వతాలు]][[వర్గం : థర్మల్ ఆఫ్ మేతన అగ్నిపర్వతాలు]]
