ఈ అగ్నిపర్వతం పేరు అజ్ఞానో మోంటే స్పిన.ఈ అగ్నిపర్వత సంఖ్య 211010.దీని ప్రధాన రకం క్రేటర్ ఆఫ్ కంపీ ఫ్లాగ్రీ.ఈ అగ్నిపర్వతం యొక్క  భౌగోళిక చరిత్ర కాంపి ఫ్లెగ్రీ అనేది 13 కిలోమీటర్ల వెడల్పు కలిగిన కాల్డెరా, ఇది నేపుల్స్ యొక్క కొంత భాగాన్ని కలిగి ఉంది మరియు గల్ఫ్ ఆఫ్ పోజువోలి కింద దక్షిణం వరకు విస్తరించి ఉంది. రోమన్ కాలం నుండి ప్రబలమైన ట్రాకైటిక్ కాల్డెరా లోపల గణనీయమైన ఉద్ధరణ మరియు క్షీణత యొక్క ఎపిసోడ్లు సంభవించాయి. తెలిసిన మొట్టమొదటి విస్ఫోటన ఉత్పత్తులు 47,000 సంవత్సరాల బి.పి. నాటివి. రెండు పెద్ద విస్ఫోటనాల తరువాత కాల్డెరా ఏర్పడింది, భారీ కాంపానియన్ ఇగ్నింబ్రైట్ సుమారు 36,000 బిపి, మరియు 40 చ.కి.మీ.3 నియాపోలిటన్ ఎల్లో టఫ్ (ఎన్వైటి) సుమారు 15,000 బిపి. ఎన్ వైటి విస్ఫోటనం తరువాత విస్తారంగా చెల్లాచెదురుగా ఉన్న సుబేరియల్ మరియు జలాంతర్గామి వెంట్ ల నుండి పెద్ద సంఖ్యలో విస్ఫోటనాలు ఉద్భవించాయి. చాలా కార్యకలాపాలు మూడు విరామాల్లో సంభవించాయి: 15,000-9,500, 8,600-8,200, మరియు 4,800-3,800 బిపి. తాజా విస్ఫోటనం 1158 లో సోల్ఫాటారా వద్ద మరియు క్రీ.శ 1538 లో కార్యకలాపాలు మాంటే నువో సిండర్ కోన్ ను ఏర్పరచాయి.[[వర్గం : అగ్నిపర్వతాలు]]
    [[ వర్గం : తెవికీ అగ్నిపర్వతాలు]][[వర్గం : క్రేటర్ ఆఫ్ కంపీ ఫ్లాగ్రీ అగ్నిపర్వతాలు]]
