ఈ అగ్నిపర్వతం పేరు అగోనియా, పిగ్ స్'.ఈ అగ్నిపర్వత సంఖ్య 210030.ఈ అగ్నిపర్వతం ప్రాథమిక రకం కోన్ ఆఫ్ ఆలోట్ వోల్‌కానిక్ ఫైల్డ్.ఈ అగ్నిపర్వతం యొక్క  భౌగోళిక గతం ఒలోట్ అగ్నిపర్వత క్షేత్రం (గారోటాక్సా అగ్నిపర్వత క్షేత్రం అని కూడా పిలుస్తారు) బార్సిలోనాకు సుమారు 90 కి.మీ.ల ఎన్.ఎన్.ఇ.కి.మీ.ల దూరంలో ఉన్న పైరెనీస్ పర్వతాలకు దక్షిణాన స్పెయిన్ యొక్క NE మూలను ఆక్రమించింది. ఈ క్షేత్రం పెద్ద సంఖ్యలో స్ట్రోంబోలియన్ పైరోక్లాస్టిక్ కోన్లు మరియు అనుబంధ క్షార బసాల్టిక్ లావా ప్రవాహాలను కలిగి ఉంది, మరియు ఇది NE అగ్నిపర్వత ప్రావిన్స్ లో భాగంగా ఉంది, ఇందులో అమ్పుర్డాన్ మరియు సెల్వా ప్రాంతాలు SE వరకు ఉన్నాయి. పైరోక్లాస్టిక్ కోన్ లు అవక్షేపణ మరియు రూపాంతర నేలమాళిగ శిలలను కత్తిరించే ఇ-డబ్ల్యు మరియు ఎన్ డబ్ల్యు-ఎస్ ఈ ఫాల్ట్ ల కూడలి వద్ద ప్రాధాన్యతగా ఉంటాయి. తాజా తేదీ నాటి విస్ఫోటనం ప్రారంభ హోలోసీన్ సమయంలో సంభవించింది, మరియు స్ట్రాటిగ్రాఫిక్ ఆధారాలు మరింత ఇటీవలి విస్ఫోటనాలు సంభవించాయని సూచిస్తున్నాయి.[[వర్గం : అగ్నిపర్వతాలు]]
    [[ వర్గం : తెవికీ అగ్నిపర్వతాలు]][[వర్గం : కోన్ ఆఫ్ ఆలోట్ వోల్‌కానిక్ ఫైల్డ్ అగ్నిపర్వతాలు]]
    [[వర్గం : అగ్నిపర్వతాల జాబితా]]

{{Infobox mountain |name = అగ్రిగన్ |elevation_m =965. |coordinates =అక్షాంశం :18.77, రేఖాంశం : 145.67 |last_eruption =1917 |location =జపాన్, తైవాన్, మరియనాస్,యునిటెడ్ స్టేట్స్
}}
అగ్రిగన్ , జపాన్, తైవాన్, మరియనాస్ ప్రాంతం,యునిటెడ్ స్టేట్స్ దేశంలో ఉన్న అగ్నిపర్వతం.284160 ఈ అగ్నిపర్వత సంఖ్య.ఈ అగ్నిపర్వతాన్ని స్త్రతోవోల్కనో అగ్నిపర్వతంగా వర్గీకరిస్తారు.ఈ అగ్రిగన్ అగ్నిపర్వతం చివరిసారిగా 1917 లో విస్ఫోటనం చెందింది.ఈ అగ్నిపర్వత అక్షాంశం 18.77 ,రేఖాంశం 145.67.సముద్ర మట్టానికి 965 మీటర్ల ఎత్తులో ఈ అగ్నిపర్వతం ఉంది.ఈ అగ్నిపర్వతం ప్రధానంగా శిల బసల్ట్ / పిక్క్రో-బసల్ట్ తో ఏర్పడింది.అందేసితే / బసల్టిక్ అందేసితే నాన్ నాన్ నాన్తరువాతి అత్యంత ముఖ్యమైన శిలలు.అగ్రిగన్ అగ్నిపర్వతం ఐదు కిలోమీటర్ల పరిధిలో సుమారు 0.0 మంది జనాభాను కలిగి ఉంది.అగ్రిగన్ అగ్నిపర్వతం పది కిలోమీటర్ల పరిధిలో సుమారు 0.0 మంది జనాభాను కలిగి ఉంది.అగ్రిగన్ అగ్నిపర్వతం నుండి ముప్పై కిలోమీటర్ల వ్యవధిలో ఉన్న జనాబ సుమారు 0.0.అగ్రిగన్ అగ్నిపర్వతం నుండి వంద కిలోమీటర్ల వ్యవధిలో ఉన్న జనాబ సుమారు 0.0.ఈ అగ్నిపర్వతం యొక్క భౌగోళిక చరిత్ర మరియానాస్ ఆర్క్ అగ్నిపర్వతాలలో ఎత్తైన, అగ్రిగాన్ లో 500 మీటర్ల లోతు, చదునైన అంతస్తుల కాల్డెరా ఉంది. దీర్ఘవృత్తాకార ద్వీపం పొడవు 8 కి.మీ. దీని శిఖరం 4000 మీటర్ల ఎత్తైన జలాంతర్గామి అగ్నిపర్వతం యొక్క పైభాగంలో ఉంది. లోతైన రేడియల్ లోయలు మందంగా వెజిటేటెడ్ స్ట్రాటోవోల్కానో యొక్క పార్శ్వాలను విడదీస్తాయి. పొడవైన కాల్డెరా 1 x 2 కి.మీ వెడల్పు మరియు NW కు విచ్ఛిన్నం అవుతుంది, ఇక్కడ నుండి ఒక ప్రముఖ లావా ప్రవాహం తీరం వరకు విస్తరించి లావా డెల్టాను ఏర్పరుస్తుంది. కాల్డెరా ఫ్లోర్ తాజాగా కనిపించే లావా ప్రవాహాల ద్వారా పైకి కనిపిస్తుంది మరియు 1917 లో ఏకైక చారిత్రక విస్ఫోటనం సమయంలో ఏర్పడిన రెండు శంకువులను కూడా కలిగి ఉంది. ఈ విస్ఫోటనం ఎస్ఈ తీరంలోని ఒక గ్రామంలో పెద్ద బ్లాకులు మరియు 3 మీటర్ల బూడిద మరియు లాపిల్లిని నిక్షిప్తం చేసింది, ఇది దాని తరలింపును ప్రేరేపించింది.[[వర్గం : అగ్నిపర్వతాలు]] [[ వర్గం : తెవికీ అగ్నిపర్వతాలు]][[వర్గం : స్త్రతోవోల్కనో అగ్నిపర్వతాలు]] [[వర్గం : అగ్నిపర్వతాల జాబితా]]



