ఈ అగ్నిపర్వతం పేరు అగ్రితాస్, వోల్కాన్ లాస్.ఈ అగ్నిపర్వత సంఖ్య 341031.దీని ప్రధాన రకం డోమ్ ఆఫ్ మస్కోటా వోల్‌కానిక్ ఫైల్డ్.ఈ అగ్నిపర్వతం యొక్క  భౌగోళిక చరిత్ర కాల్క్-ఆల్కలైన్ ఆండిసిటిక్ మరియు లాంప్రోఫైర్ సిండర్ కోన్లు మరియు లావా గోపురాలతో కూడిన ఒక సమూహం, అనుబంధ లావా ప్రవాహాలతో పాటు, ప్యూర్టో వల్లర్టాకు సుమారు 50 కి.మీ.ల దూరంలో మస్కోటా పట్టణానికి సమీపంలో ఉంది. రియో అమేకాకు దక్షిణాన ఉన్న జలిస్కో బ్లాక్ యొక్క ఎక్స్ టెన్షన్ గ్రాబెన్స్ లో ఉన్న పొటాసిక్ అగ్నిపర్వత క్షేత్రాల సమూహంలో మాస్కోటా అతి పిన్న వయస్కుడు. ఇక్కడ చాలా వోల్కానిజం రెండు ఎన్ ఎన్ డబ్ల్యు-ఎస్ ఎస్ ఇ-ట్రెండింగ్ గ్రాబెన్స్ కు పరిమితమై క్రెటాషియస్ యాష్-ఫ్లో టఫ్ లను కట్ చేస్తుంది. అతి పిన్న వయస్కుడైన విస్ఫోటనం మాస్కోటాకు ఉత్తరాన ఉన్న వోల్కాన్ మాల్పైస్ వద్ద ఒక బసాల్టిక్-ఆండీసైట్ లావా ప్రవాహం; నేల అభివృద్ధి లేకపోవడం మరియు తక్కువ వృక్షసంపద ఇది కొన్ని వేల సంవత్సరాల నాటిది కావచ్చునని సూచిస్తున్నాయి (కార్మికేల్ ఎట్ అల్., 1996). ఈ క్షేత్రం అగ్నిపర్వత శిలల యొక్క అసాధారణ వైవిధ్యానికి ప్రసిద్ధి చెందింది, మరియు భూమి యొక్క అతి పిన్న వయస్కుడైన మినెట్స్ (ల్యాంప్రోఫైర్స్) ను కలిగి ఉంది, రేడియోమెట్రిక్ యుగాలు 0.07 +/- 0.08 మిలియన్ సంవత్సరాల వరకు ఉన్నాయి.[[వర్గం : అగ్నిపర్వతాలు]]
    [[ వర్గం : తెవికీ అగ్నిపర్వతాలు]][[వర్గం : డోమ్ ఆఫ్ మస్కోటా వోల్‌కానిక్ ఫైల్డ్ అగ్నిపర్వతాలు]]
