అగ్వా అనే పేరుగల అగ్నిపర్వతం మీéక్సికో అండ్ సెంత్రల్ అమెరికా ప్రాంతం,గ్యాటెమల దేశంలో ఉంది.342100 ఈ అగ్నిపర్వత సంఖ్య.ఈ అగ్నిపర్వతం ప్రాథమిక రకం స్త్రతోవోల్కనో.ఈ అగ్నిపర్వతం 14.465 డిగ్రీల అక్షాంశం మరియు -90.743 డిగ్రీల రేఖాంశంలో ఉంది.ఈ అగ్నిపర్వతం యొక్క శిఖరం సముద్ర మట్టానికి 3760 మీటర్ల ఎత్తులో ఉంది.ఈ అగ్నిపర్వతం ప్రధానంగా శిల అందేసితే / బసల్టిక్ అందేసితే తో ఏర్పడింది.అగ్వా అగ్నిపర్వతం ఐదు కిలోమీటర్ల పరిధిలో సుమారు 114404.0 మంది జనాభాను కలిగి ఉంది.అగ్వా అగ్నిపర్వతం పది కిలోమీటర్ల పరిధిలో సుమారు 2530449.0 మంది జనాభాను కలిగి ఉంది.అగ్వా అగ్నిపర్వతం ముప్పై కిలోమీటర్ల పరిధిలో సుమారు 7441660.0 మంది జనాభాను కలిగి ఉంది.ఈ అగ్నిపర్వతం యొక్క భౌగోళిక చరిత్ర ఫ్యూగో మరియు అకాటెనాంగో అగ్నిపర్వతాలకు ఎదురుగా ఉన్న ఆంటిగ్వా, గ్వాటెమాల నగరానికి సౌష్టవ, అటవీ, అటవీ వోల్కాన్ డి అగువా స్ట్రాటోవోల్కానో ఆకట్టుకునే నేపథ్యాన్ని ఏర్పరుస్తుంది. వివిక్త బసాల్టిక్-ఆండీసైట్ నుండి ఆండీసైట్ భవనం అన్ని దిశల నుండి కనిపించే ఒక ప్రముఖ మైలురాయిగా చేస్తుంది. 280 మీటర్ల వెడల్పు గల ఒక వృత్తాకార బిలం ఎన్.ఎన్.ఇ పై పగిలిపోయింది, ఆరు చిన్న పిట్ క్రేటర్లు ఎన్.డబ్ల్యు పార్శ్వంలో ఉన్నాయి, మరియు రెండు చిన్న శంకువులు ఎస్ పార్శ్వంలో ఉన్నాయి. హోలోసీన్ టెఫ్రా నిక్షేపాలు లేదా నమోదు చేయబడిన విస్ఫోటనాలు ఏవీ అగువా నుండి తెలియదు, కానీ దాని పేరు (నీటి అగ్నిపర్వతం) 1541 సెప్టెంబరు 11 న వినాశకరమైన బురద ప్రవాహం నుండి ఉద్భవించింది. ఈ బురద ప్రవాహం స్పానిష్ కాంక్విస్టాడోర్స్ స్థాపించిన మొదటి గ్వాటెమాలన్ రాజధాని నగరమైన సియుడాడ్ వియెజాను నాశనం చేసింది, ఇది సమీప ఆంటిగ్వాలో కొత్త రాజధాని స్థాపనకు ప్రేరేపించింది.[[వర్గం : అగ్నిపర్వతాలు]] [[ వర్గం : తెవికీ అగ్నిపర్వతాలు]][[వర్గం : స్త్రతోవోల్కనో అగ్నిపర్వతాలు]] [[వర్గం : అగ్నిపర్వతాల జాబితా]]



