ఈ అగ్నిపర్వతం పేరు అగ్వా అగ్రియా, ఆసోల్స్ డి.ఈ అగ్నిపర్వత సంఖ్య 343070.ఈ అగ్నిపర్వతాన్ని థర్మల్ ఆఫ్ సాన్ వీసెంటే అగ్నిపర్వతంగా వర్గీకరిస్తారు.ఈ అగ్నిపర్వతం యొక్క  భౌగోళిక గతం చిచోంటెపెక్ అని కూడా పిలువబడే శాన్ విసెంట్ అగ్నిపర్వతం యొక్క జంట శిఖరాలు ఇలోపాంగో సరస్సు యొక్క SE వరకు నాటకీయంగా పెరుగుతాయి. ఆధునిక అండీసిటిక్ స్ట్రాటోవోల్కానో ప్లైస్టోసీన్ లా కార్బోనెరా కాల్డెరా లోపల నిర్మించబడింది, దీని అంచు దాని ఎస్ డబ్ల్యు వైపు మాత్రమే కనిపిస్తుంది. ఎల్ సాల్వడార్ లో రెండవ ఎత్తైన శాన్ విసెంట్ అగ్నిపర్వతం కాల్డెరా లోపల పెరిగి, WSW-ENE రేఖ వెంబడి ఉన్న శిఖరాగ్ర క్రేటర్లతో ఒక జత అగ్నిపర్వతాన్ని ఏర్పరుస్తుంది. ఉత్తర మరియు దక్షిణ పార్శ్వాలు మధ్య వెంట్ నుండి లావా ప్రవాహాలతో కప్పబడి ఉంటాయి, కానీ తూర్పు వైపున లావా ప్రవాహాలు ఎగువ వైపున ఉన్న ఒక వెంట్ నుండి ఉద్భవించాయి. వోల్కానిజం హోలోసీన్ లోకి కొనసాగింది, కానీ తాజా లావా ప్రవాహాలు పొరుగున ఉన్న ఇలోపాంగో నుండి ప్రధాన క్రీ.శ. 260 విస్ఫోటనం నుండి నిక్షేపాలతో కప్పబడి ఉన్నాయి. 1643 మరియు 1835 లో చారిత్రక విస్ఫోటనాల నివేదికలు అసత్యం (క్రియాశీల అగ్నిపర్వతాల కేటలాగ్ ఆఫ్ ది వరల్డ్; సాపర్, 1917), కానీ ఉత్తర మరియు పశ్చిమ పార్శ్వాలలో అనేక వేడి బుగ్గలు మరియు ఫ్యూమరోల్స్ కనిపిస్తాయి.[[వర్గం : అగ్నిపర్వతాలు]]
